"rating":"4.0",
"reviewcomment":"We went to this place on our trip to Spain mostly because of Yelp reviews.  It was good for what it was - a Spanish Dive Bar.  For €10  we had two beers and they gave us two heaping plates of various tapas.  Definitely not the best tapas out there but it filled the belly.  All and all great drinking food.  Seemed like there were a lot of college kids who were studying abroad and a fair amount of locals.  If I went back to Spain and I was looking to have a few drinks and something to pick on, this place would certainly be in the consideration.",
