"reviewcomment":"Known as Sydney&#39;s longest-running brew-pub (established 1842), Lord Nelson cannot be missed on your to-go list.<br><br>Located in The Rocks, it&#39;s such a gem. I came here to end my long day touristing around Sydney. It was perfect. Though it was bustling, we found a corner table right by the brewery edge. The decor fits, and staff are super friendly. I ordered the Old Admiral, the beer comes out of this awesome looking stein. We got a little hungry, and ordered a pizza, sometimes, that is the best combo for beer. <br><br>The atmosphere was great. I could&#39;ve stayed here all night. And, it&#39;s genuine; a pub producing beer on tap served exclusively only at Lord Nelson.",
