"rating":"4.0",
"reviewcomment":"My boyfriend used to attend QANTM College down the street (and works there now) and brought me here when I was asking for good Thai food. He comes here pretty often for lunch and had fond memories of the location and the food while he was a student and wanted to share it with me.<br><br>This place is absolutely, hands down amazing in pretty much every way. I don&#39;t care if it is crowded, or a hole in the wall (those are the best places though), or loud or whatever.  The food is awesome, the people working here are friendly (they do want to turn the tables, which is understandable for a small place), and I love this place as much as he does.<br><br>I&#39;m a massamun curry fanatic, and the massamun here didn&#39;t not disappoint. I call it Thai pot roast, and this stuff is aromatic, flavorful, and rich. Perfect for a cold winter&#39;s day. The pra ram chicken is also lovely here.<br><br>Spice I Am is hands down the best Thai food I have had in my lifetime, and I have eaten quite a bit of Thai in my nearly 30 years!",
