"rating":"4.0",
"reviewcomment":"I don&#39;t know if these actually count as Australian meat pies. . . There&#39;s actually like proper meat in them . . Where&#39;s the miscellaneous chunks and &#39;gravy&#39;?. . And why doesn&#39;t the pastry disintegrate as I eat it?<br><br>The &#39;pies&#39; here are amazing though. I came for lunch so I can&#39;t comment on the dessert pies, but the savoury are great. I went for the &#39;North African style slow roasted lamb with chermoula&#39;. With flavours like that you know they&#39;re going to be special and it didn&#39;t disappoint. The pastry was crisp and packed to the bring with the delicious lamb.<br><br>It&#39;s a nice relaxed vibe, with signs up encouraging you to use your hands &#39;it&#39;s just a humble pie!&#39; The sweet pies look amazing so I&#39;ll definitely have to come back, and if that isn&#39;t enough they serve some good local beers!",
