"reviewcomment":"When you in the town hall area around 6 ish and feel a bit peckish already for dinner. Do not hesitate to walk to Chefs Gallery  on Bathurst St just down from the KFC. <br><br>Generally if you have the foresight you can book ahead online but alas you can always leave you name with the hostess on the door and wait probably around 5-10 min sometimes its longer and sometimes your&#39;re in luck! <br><br>As soon as we arrived there were at least 12 people waiting outside so we asked for a table for 2 and the hostess asked if we didnt mind bench seats....of course not! <br><br>Zing! Instant table and we faced the kitchen so we could see the guy making fresh noodles! Awesome<br><br>We ordered the Roti Peking Duck, BBQ Fried Noodles and chilli chicken (which we secretly thing should be called KUNG POW Chicken!  Its not hot or spicy its just an awesome name)<br><br>Everything as usual was mouth-watering! Teamed up with some iced lemon tea! Delish! <br><br>Waiters are friendly and efficient, Food is quite fast too!<br><br>Bookmark this place for future visits!",
