"reviewcomment":"I&#39;ve been here a few times... It&#39;s seriously one of my favorite bars in Sydney, and I&#39;m not a bar person, to be honest. It doesn&#39;t get as crazy busy or too noisy that it&#39;s impossible to talk, and the other patrons don&#39;t get as drunk/sleazy as other bars.<br><br>The last time I went here was last Saturday to celebrate a friend&#39;s birthday. I hadn&#39;t been in a while (over a year), and they&#39;ve had some big changes. Namely, they got rid of their existing kitchen, which served standard bar food to a dumpling bar (!!) I don&#39;t know how I feel about this. I love dumplings, but as bar food...? Though they did have things like fried calamari and chicken wings. But the menu had stuff like cheeseburger gyoza (good), pepper and wagyu gyoza (too salty), and some dessert gyozas (good.) The food is a little pricy for what you get, though they are pretty tasty.<br><br>I like staying inside on the first floor with all the couches -- good for catching up with friends! The dance floor is upstairs, and the DJs are usually pretty good too.",
