"categorystrlist":"Coffee & Tea,         Cafes",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/bRwNHuu13a1eBGhVbo_ORA/l.jpg",
"rating":"4.5",
"reviewcomment":"exquisite specialty coffee. yes i said it. sorry Starbies, you&#39;ve got nothing on Oz when it comes to coffee. every cup of coffee is special, the flavors are bold but not burned, a traditional yet rich, true coffee flavor and smell. <br><br>we came for Coffee Cupping, like wine tasting for buyers but open to the general public. while we waited in the shop, you could hear the buzz of conversation, grinding of beans, aromatic coffee smell, and see cups beautifully foam frothed toped with latte art.  when the barista approached and asked us if we were here for the Coffee Cupping session I nodded and she motioned to follow her. we did into the back of the store, through the back wall, up the stairs into a dimly lit room let up with a long table prepared with cups of hot water, coffee grinds, and spatoon cups. the head Barista introduced himself and took us through the Campos coffee relationship with the farmers, the processing, and the cupping process. it was a very educational and enjoyable experience.  <br><br>to top it off, we got to each take home a bag of beans and had the opportunity to buy super special harvests from Kenya and Brasil. it may be a few months, but i can&#39;t wait to come back!",
