"rating":"4.0",
"reviewcomment":"I had a full day down under today. So I wanted to eat something late and They were open late while the other places were closing. Bonus! So I hustled from my hotel to grab a bite. I was not disappointed! The Rocks Cafe is directly across from the MCA(Museum of Contemporary Art). The place is small but  that&#39;s good! Old hardwood floors are always a bonus in my book for decor.  The staff were very friendly and the service was excellent.  I ordered the Spicy Mexican Burger and it was so GOOOOOD!<br>The burger was big and thick with peppers, tomato salsa, jalapenos and cheddar cheese! The burger matched the bun size!  The fries were crunchy and just right! The meal was so good I was singing Desperado on top of the table like Antonio Banderas. (in my mind of course) :)   Overall great food and great service! I will probably hit this place again tomorrow night because I will be out most of the day sightseeing!",
