"categorystrlist":"Turkish",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/6vRz_2S2Xp6RcFUIy7btjQ/l.jpg",
"rating":"3.5",
"reviewcomment":"Don&#39;t discount Sultans Table as a typical takeaway spot. The front shop is set for takeaway, but the queue out front for a table on the back patio is a signal that this is no ordinary Turkish joint. Once you&#39;re seated in back you&#39;ll get a true feel for what this restaurant is all about. <br><br>Tables are set for larger parties but there were a few couples enjoying dinner together. We had a group of 7 and started with the medium sized mixed dip plate, the zucchini fritters, and the chicken Pide. There was more than enough food to get us going, but we needed more bread for the dips. <br><br>Being BYO made it nice and easy to relax while we waited for the next set of mains to arrive. We shared the mixed grill kebabs, chicken kebabs, and grilled lamb kebabs along with a couple other small dishes.  All of the food was well presented and tasted amazing.  We all walked out of there completely stuffed wishing we had room for desert. When the bill came we were blown away and thought they got something wrong. For 7 people to gorge themselves it was only $108 total!<br><br>We will be back!",
