"rating":"3.0",
"reviewcomment":"I think people are being a little harsh on Hard Rock Cafe Sydney. I think if you go there with the expectation that it&#39;s not going to be fine dining, but just overpriced American diner type food served in a touristy type restaurant (in an equally touristy location), you won&#39;t be disappointed. <br><br>The only real difference I noticed with this Hard Rock Cafe and the others I&#39;ve been to is that the one at Darling Harbour is massive. It was a Monday night when we visited and there were at least two large rooms which were curtained off, presumably to be opened at weekends and busier times. There was a live band playing, and the area we were sitting in was full with a mix of groups of locals and smaller tables of tourists. <br><br>The service was fine -  probably wasn&#39;t as good as you&#39;d find in some of the other Hard Rock locations, but that&#39;s because it&#39;s Australia and the waiters aren&#39;t expecting to get the American sized tips their colleagues in other countries receive.",
