"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/VASYiMSZdmwsCqY_pw0mbQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Bottom Line - Simple and delicious Italian food. Lovely atmosphere. Reasonable prices.<br><br>I don&#39;t know how we haven&#39;t written about Il Baretto sooner. It&#39;s been one of our favourite neighbourhood dinner spots since we moved here (nearly a year ago!!). With pastas that are exactly the kind of thing you crave when you want good Italian food - we&#39;ve never had anything that didn&#39;t hit the spot. Nothing too fancy - just bowls of simple and delicious food at a very reasonable price.<br><br>Our two favourite dishes are the Beef Lasagna and the Duck Ragu - signature dishes that are always on the menu. And you must get the Panna Cotta for dessert, though the Tiramisu is pretty amazing also. <br><br>Things to note:<br>- Il Baretto is BYO. They don&#39;t serve any alcohol at all so hit up the clock bottle shop just one block up on Crown street before hand. <br>- It is also CASH ONLY. There&#39;s an ATM inside the Carrington just across the street.<br>- It&#39;s also quite small so there is often a wait, but they will take down your number and give you a call when they have a table for you. Go across the street and have a drink at the Carrington while you wait.",
