"rating":"4.0",
"reviewcomment":"Came here on a date night right before Christmas after hearing great things.   It&#39;s only a block away from where I live so I was pretty excited to check it out. <br><br>It was really busy for a Monday so we took a seat at the bar. After scanning the menu, we decided to do the Greek sampler (can&#39;t remember what it&#39;s called). <br><br>It was fantastic!  Our dinner started with some warm olives and warm pita bread. Then we got a caviar spread that was actually delicious. I&#39;m not one for fishy tasting things and this spread was really good!<br><br>Then we had my favorite course, the grilled cheese with honey. This was absolutely to die for.  Words can&#39;t even do justice. Just make sure you get it no matter what. <br><br>For the main course we had lamb with a side salad of tomatoes, cucumbers, and feta and roasted potatoes. The salad and potatoes were good but the lamb was FANTASTIC!  I don&#39;t love lamb but I would go back for more at Apollo. <br><br>Lastly we had baklava for desert which I have to admit was my least favorite course. <br><br>Regardless, this meal costs $55 per person, a bargain for Sydney and Potts point!  Highly recommend.",
