"reviewcomment":"Oh.My.Word. Come hungry, and with several hours to spare, and leave in the perfect food coma, ready for a nap to dream about all of the amazing food you just had.<br><br>I&#39;ve been to 4Fourteen a few times now and haven&#39;t been disappointed yet with any of their dishes. The food is designed to share and for the full experience definitely think about getting the tasting menu- it&#39;s a great reflection of all of the different tastes the restaurant has to offer and that way you don&#39;t have to make any tough decisions.<br><br>If you don&#39;t do the tasting menu, make sure you get the miso smoked salmon and that you try the ham and cheese croquettes. You&#39;ll also want to try the lamb ribs as I&#39;ve never seen meat that falls off the bone that easily and that is so tasty.<br><br>For the main event, I&#39;ve had the roasted lamb shoulder three times now. Each time I&#39;ve gone I&#39;ve thought to myself that I really should try something else, but then I wonder why I should mess with the perfection that is this dish!<br><br>The lamb shoulder comes with mashed potatoes that have been infused with several sticks of butter as well as a nutty quinoa dish, and you&#39;ll want to lick your plate clean, even though at this point with all of the other wonderful dishes (not to mention the killer homemade bread and butter to start with) that you&#39;ve had already.<br><br>And don&#39;t even think about skipping dessert- the white chocolate sandwich with dulce de leche will change your world.<br><br>Wash it all down with a cocktail or two- the Rude Boy is a favourite of mine- and just roll yourself out the door when it&#39;s all said and done.<br><br>Do expect to sit for 3 hours or so if you opt for the tasting menu so make sure you&#39;ve got the time to really savour the experience!",
