"rating":"2.5",
"reviewcomment":"3.5 stars. This restaurant has a great location in Darling Harbour. It&#39;s large enough for a Karaoke event, a small dinner for 2, and definitely large enough to accommodate our tour group of 40 people. One of the best parts was the free wifi of course! The kiddos were happy to Instagram and text their friends and family from the other side of the world. We had a set menu and were given choices of pizza, fish and chips, or pasta. Obviously I chose pizza topped with fresh tomatoes. The portions were large... I took my leftover pizza home and ate it later as a snack. Our meal came with salads as well. We also had the option of ordering off the set menu. They&#39;re more allergy conscious, which the US needs to catch up on. <br><br>Decor of the restaurant is trendy, dark, upscale, but unpretentious. The servers were patient and friendly with our large group. You definitely pay for location, but the views are pretty sweet.",
