"rating":"4.0",
"reviewcomment":"The flying fish - what can I say? This was the best seafood meal I have had in Australia and I must also tell all of you the service was impeccable! <br><br>We had a party of four for lunch and all had a great bottle of red and white - entrees included the oysters - several types available if you are picky where they harvest yours. They were simply perfect. Additionally, we indulged in some sashimi and a fine order of foie gras --- wow!<br><br>For our mains, we all indulged  on the blue eye trevalla with a delicious white curry. The fish was so light and melted like butter. Nothing short of amazing. <br><br>The sides, like the flying fish hand cut fries (potato logs) were perfectly fried with chili salt doused on the top of them. You simply could not eat just one. I caught myself going back a couple of times as they were irresistible. <br><br>Granted, the flying fish will cost you a pretty penny, you will be satisfied that it was worth it!",
