"rating":"3.5",
"reviewcomment":"Of the Glebe Point Road cafe cluster, Clipper remains my favourite. There are three reasons for this. <br>1. The light: it&#39;s not as dark as the old Badde Manors, and although Clipper is small, it always feels airy. <br>2. The smoothies: these are always filled up with fruit, yogurt and ice-cream - they really don&#39;t skimp out on them. <br>3. On weekdays, it&#39;s a good place to sit and read, and the staff are pretty happy for you to hang around doing this (though they may ask if you want another coffee). <br><br>Clipper&#39;s coffee is pretty good too (not exquisite, but pretty satisfying). I like the tall tables with stools, if you&#39;re lucky enough to get one. The staff are quite friendly and the atmosphere is relaxed and not tooooooo trendy. <br><br>Clipper&#39;s baked eggs are filling &amp; tasty (though not really extraordinary creations, if you&#39;re a foodie you may not be that impressed). The salads are filled with proteiny goodness too. <br><br>Prices are fairly moderate. Also, they have a nice little display shelf at the back, which previously held all manner of cactuses, but right now has little ceramic trinkets. Very cute.",
