"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/gUiyGJ-jbsmfQE6ewoYiww/l.jpg",
"rating":"3.5",
"reviewcomment":"What do you do when it is baking hot outside and you are lost in The Rocks? Come here to Baroque without a reservation but with an appetite for unique and tasty...<br><br>We were lucky enough to be seated inside, on stools, right by a window where we could see the harbor bridge! The much appreciated breeze whistling through the window was strong so we decided to order heavier fair, rather than a salad that might blow across the restaurant!<br><br>My double espresso and my wife&#39;s chai latte helped raise our energy level to take on our brunches. Poached eggs with Serrano ham and spinach on a bit of toast doesn&#39;t sound too exotic. But, when the eggs are poached to runny perfection, I&#39;m in heaven. <br><br>We topped off our brunch with incredible macaroons, covering the entire flavor spectrum from appetizing to insanely delicious. <br><br>Full of energy and satiated, we were more than ready to continue our Rocks adventure!",
