"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/_V-oy3U98n_-4DzwGsgDpQ/l.jpg",
"rating":"3.5",
"reviewcomment":"Khaosan was a trend setter on Pitt st, where cheap Thai food was aplenty. But with trendy decor, tuktuk at the front, and streetstall style dessert offering, you know this was different.<br><br>The food is just as cheap but the menu is brave, with lots on offer and flavours that satisfy the tastebuds. No white people Asian food here, its sweet spicy sour and salty, just how it should be done.<br>We had the intestines, pad se ew, som tum,chicken satay, stir fry pork belly and crazy chicken. Tip. The chicken wings are individual servings, we chose the crazy chicken which is a plate of wingettes. <br>The som tum with pickled raw crab is a must try but watch the spiciness ;)<br><br>The Thai ice tea is a must have as it will be the only thing that can sooth all that chilli ;)<br><br>The only downside is with such great Thai food, the service was overwhelmed and very slow, and miscommunication on orders can happen easily.",
