"reviewcomment":"2 originals please! That&#39;s Mojito for those that don&#39;t know what i&#39;m talking about. <br><br>If you get to be here during their happy hour time frame you can snag yourself Mojito&#39;s for the cool price of $6!  <br><br>If you are with friends that opt to get the Grande Mojito basically a bucket of this delicious stuff will help you start the night in a cheerful mood! (You get straws to drink from the bucket so it feels like you are on spring break or something ;) <br><br>This places always seems like the first visit of your night out beacuse when you get there during happy hour its packed and then if you get there around 8pm the bar is your&#39;s for the taking. <br><br>I have yet to try the food as you tend to fill up on Mojito&#39;s then move onto the next bar hop. So i can only vouch for their liquids! <br><br>If you had enough of mint then opt to try the Mary Pickford. She&#39;s a little bit fancy but not too sweet.",
