"rating":"4.5",
"reviewcomment":"I see what I like and I Jimmy Lik(e)s what I see; all over the Jimmy Liks menu, that is.<br><br>Tucked away in the quietly tree-lined Victoria St, Potts Point (Kings Cross&#39; lesser known, better looking sibling) is this fantastic little SE Asian restaurant.<br><br>Every round packs a punch; co-diners bit into the skewers while I took the fritters. Second round saw the wagyu beef and an eggplant curry land on our plates.<br><br>Simple finger food has never looked so good! Not only was the food divine but each serving was plated in a unique and exciting way: a small wooden tray holds your hawker bites and myriad bowls of every shape and size carry your curries.<br><br>Bear warning: cosy communal eating means my dinner guest accidentally sassed another diner, thinking they were a waiter. Keep your eyes peeled in the dim mood lighting for the friendly staff, who tripped over each other to assist.  <br>(Note that the other diner ALSO went out of his way to help us. Talk about a good service!)<br><br>Final word: If you love a spicy traditional Asian dish and an authentic experience then go no further.",
