"rating":"4.5",
"reviewcomment":"If you love books and lattes this is the place to be.  It is filled with mostly used books and great finds at that. For Australia the prices are rather cheap for a bookstore, there is a wide variety and the books are usually ranging from 7 AUD to as much as 11 AUD per book (this is how much I have paid anyways). I have bought a lot of travel books here used, also language books too, great place for these in particular because they tend to be very overpriced new.  They also have a really cool music room upstairs with a piano and sheet music to buy if thats your interest. <br><br>Their cafe is very cool, and outdoors but still connected in the back to the bookstore building. In general the staff is nice but don&#39;t expect much besides after you paying for your coffee they bring it to a table for you.  They also have empty water pitchers you can take off of one table and also glasses to take for having water at your own table. Also beward bathroom is outside...so as you can imagine creepy crawling friends will be joining you for your after coffee pee break.",
