"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/gJynzXSbP45rgO-pjvfptA/l.jpg",
"rating":"3.5",
"reviewcomment":"Good food..tick!<br><br>Great atmosphere... tick!<br><br>Great service. .. tick!<br><br>Came here as part of a group of 17 to celebrate a birthday.  We were able to reserve the lounge area for pre dinner drinks which was a great little area of couches and chairs. There was also a great bar area where you are able to sit and watch the bartenders make their concoctions.<br><br>As we were a large group we had to select the $45 pp set menu. The menu was great with the grilled corn a definite star of the menu. The churros were also delicious and I couldn&#39;t help but smother the churro in the chocolate sauce! Only gripe would be that we could have done with more food!<br><br>There was a great selection of drinks including a large selection of tequila! The sangria however was a bit disappointing as it was a bit weak and on the watery side.<br><br>The service here was faultless- the wait staff was attentive and very accommodating with our large group. Food came out promptly and wait staff were on the ball with taking drinks orders leaving no one dry! They happily helped with my requests for pre dinner drinks and organising the birthday cake. Also there was no cakeage which is a bonus!<br><br>Perfect place for a celebration, for groups, or drinks at the bar and a fun night out!",
