"rating":"4.0",
"reviewcomment":"I saw the baker in the back literally bashing the life out of the bread dough he was making (with a baseball bat) and that has since absolutely confirmed my love affair with this Patisserie. My stomach told me the eclair I was eating was the best it has ever had, and the coffee is great every time I&#39;ve been here. And the sourdough bread, well, words fail me in describing it. You may have gathered I&#39;m a little something akin to bread obsessed (well I used to be before I got caught up in lo-carb diets etc. Yeuch!) and you would be right. The bread is un-effing-belieavable from this place. amazingly good, and on par with Brasserie Bread, and Sonoma.<br><br>Oh, and I hear the mark of any good patisserie goes down to the nitty-gritty - the simplest yet hardest of all pastries to master - the citron tart. 100% perfect in my book. Absolutely 100% perfect. Thanks to Jon for taking me here first!",
