"rating":"2.0",
"reviewcomment":"Good salsa dancing clubs are hard to come by in Sydney, what with local men&#39;s general lack of rhythm and the scarcity of Latin American types living in the city. <br><br>La Cita is one of the best I&#39;ve found so far. Unlike cheesy themed spots like Vivaz in The Rocks or regular bars that host weekly salsa nights like Establishment and Cruise Bar, this bar felt true to places in Spain and South America - cocktail bars and clubs where partner dancing is a natural part of the evening.<br><br>Free from tacky decorations and massive hen&#39;s night crews, the few times that I&#39;ve been here on Friday and Saturday nights have always had a live band playing. The dance floor takes up a generous portion of the floor space, while the lengthy bar has some communal tables and stools nearby. When the dancing gets too much, you can take to their balcony overlooking Darling Harbour for a break, mojito in hand.",
