"rating":"3.0",
"reviewcomment":"Much like the soul of a crackhead, Cammeray was a dead grey hole before Epoque opened up and single-handedly made the strip cool again, attracting other like-minded businesses and giving the style-starved punters on either side of the hill somewhere to bust out their best boat shoes and pressed checked shirts.  <br><br>The beer menu is ginormous, and I mean that both literally and figuratively - there&#39;s like 100 different drops on a menu the size of a bed sheet (but with less stains). The drinking is good - loads of dark, obscure, monk-brewed drops - but I come here for the mussels. They&#39;re astonishingly tasty. Enormous pots of red curry flavour, or Provencale, or white wine, chili and coconut, or blue cheese, or . . . look, just get some mussels up ya, okay? They&#39;re eighteen kinds of awesome. <br><br>Clutches of bright-eyed mid-twenty-somethings prop up the tables on lazy weekend afternoons, and there are always a couple of attractive girls in floral summer dresses nursing raspberry beers for a reason I don&#39;t understand but don&#39;t feel like questioning.",
