"rating":"4.5",
"reviewcomment":"OK, I&#39;m in love.<br><br>All the previous reviewers are not lying - this place is amazing. A new absolute favourite. <br><br>The food is incredible. We had &#34;jamon&#34; in all varieties (Espanol for ham, mate). I had a mushroom tart topped with jamon &amp; truffle oil... I mean, it was sex on a plate. I also had the scallops with morcilla...  this was me being open-minded about morcilla (morcilla is blood sausage). I can say I don&#39;t like morcilla. It just tastes like plain, gross animal fat to me. But honestly, the scallops were exquisite in taste and presentation. <br><br>My friends got this epic potato dish I was super jealous of, I had a bite and I am definitely getting one to myself next time and also the witlof dish, which was different and interesting, but really really good (witlof, blue cheese and roasted hazelnuts).<br><br>THEN THERE WAS DESSERT!<br><br>We got 3 and shared. The chocolate terrine with salt and olive oil (dense and rich, but perfection), the dulce de leche tart and the prune and brandy cheesecake.... seriously all luscious and delicious.<br><br>Hands down my favourite tapas experience, ever. Love it. Will be back.",
