"rating":"3.5",
"reviewcomment":"We were in Sydney for only one night this past weekend and good old Yelp pointed us in the direction of Lumiere for a breakfast treat. It was a Sunday morning and it was relatively busy inside, which was fine with us as it was also quite stuffy in there and the tables outside made for some perfect people-watching.<br><br>As soon as we sat down we were greeted by a friendly waiter bearing water and taking our coffee order. As we perused the menu our coffees promptly arrived, and I dove into mine. It was good! <br><br>For breakfast my wife ordered the muesli, which looked great...but I can have muesli  at home any day, so I ordered the Brioche French Toast with maple syrup, banana and bacon...wow! My towering breakfast came out in no time, swimming in syrup with a ridiculous amount of bacon on top. Wait..that&#39;s impossible, you can never have too much bacon. The french toast was quite amazing. The bread was soft and the bacon crispy and it all went together incredibly well. If we&#39;re back in the Surry Hills area again any time soon we&#39;ll definitely head back here for brekkie. Yum!<br><br>Aw man...now I want some bacon.",
