"rating":"3.5",
"reviewcomment":"I first came to this place with a friend and although that friendship has been and gone this cafe hasn&#39;t! I fell in love with it instantly because of the great selection of music they play softly in the background, stuff like The Beatles, Radiohead, other classics and some new stuff like Beach House. <br>The coffee here is great too, strong hard hitting stuff. I usually just order a flat white but when I&#39;m feeling fancy I get the affogato - so delicious! I&#39;ve also tried a mint and pineapple frappe and it was so yummy and their other ones are too. On the few occasions I&#39;ve ordered food it was very good, though a tad overpriced. <br>The decor is low key and dark so it&#39;s good if you want some privacy to study, with your laptop or without since they have free WiFi that you just ask the password along with your food/drink order. Very friendly service and they don&#39;t judge you for prolonged studying or WiFi usage - something I appreciate a lot and have taken advantage of. There&#39;s an upstairs patio that is quieter, has better lighting and which immediately head for when I come here.<br>Hot tip! If you&#39;re a Sydney uni student they offer Access discounts for transactions over $10!",
