"categorystrlist":"Bars,         American,         Jazz & Blues",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/fpQ5UDR3WPpQ7q3kBagYUQ/l.jpg",
"rating":"2.5",
"reviewcomment":"Question: How many ways can you bake an egg?<br><br>Answer: Why bother, The Bourbon will bake a KICK-BUTT egg for you!<br><br>They&#39;ll even throw in the honey+ricotta or chorizo, pending your choice of poison. Served in a metal wok, a la all hipster cafes circa 2012, the baked egg literally put a smile on my face. I took it with the mixed juice featuring passionfruit and a small flat white. The perfect combination for a Bourbon brunch.<br><br>I never dreamed that I&#39;d one day be eating brunch at The Bourbon, once a club on the KX strip. I&#39;d spent the odd night bustin&#39; a poorly thought out move there, but now a live smooth musician isn&#39;t even a little out of place in this new groovy cocktail bar and eatery.<br><br>The service needs polishing. Staff are distracted in a nearly empty cafe, standing in hidden corners and staring off into the early morning gloom.<br><br>The bill figuratively stopped my heart. Eating for one is expensive, I wouldn&#39;t recommend trying to feed 3 kids and a puppy on your easy Sunday morning. <br><br>The menu is also extremely boutique(read: limited), and not necessarily child appropriate. <br><br>Definitely not the place to go for a greasy big breakfast and a coke, but the food packs a punch.",
