"rating":"4.0",
"reviewcomment":"From the outset, we were behind the 8 ball. We turned up on a Tuesday night expecting we could walk in and snare a table. Alas, Rice Paper is a little more popular than that. <br><br>This, dear reader, is where the skill of customer service enters the scene, stage left. The Rice Paper staff couldn&#39;t accommodate us then and there, but probably could in around 20 minutes and they would call us when ready. As a group of 5 we said ok and headed off for a beer. True to their word they called us when a table was available and we walked straight in. <br><br>Let&#39;s get to the crux of it. The food. Wonderful. Just like in Vietnam the food is fresh, succulent and dances around the palette like Natalie Portman wished she could have in Black Swan. Sorry, I digress. <br><br>If you want conversation on a busy night, this isn&#39;t the place. There is no sound dampening so even soft conversation for each table mounts to a deafening crescendo fairly rapidly. They would be wise to look into this. <br><br>It&#39;s not, however, a deal breaker. The excellent food and the wonderful staff make the place.",
