"reviewcomment":"Stopped here for a quick late lunch.  Surprised to have found this place because it&#39;s so tiny (as everyone else has seemed to mention).<br><br>FOOD<br>Given practically everyone that worked there was Asian I opted for the Asian burger.  Teriyaki Chicken Burger with Wasabi Mayo, Pineapple and Pickled Ginger. ($10.50)<br><br>When eating Teriyaki Chicken you don&#39;t normally put wasabi/mayo/wasabi mayo on it.  Well I don&#39;t anyway.  Wasabi and pickled ginger are usually reserved for sushi not teriyaki.  On this occasion it seemed to work though!  Pineapple was a bit iffy though.  Not very Japanese like.<br><br>Good serving of Peri-Peri sauce with my small chips ($3).  Nice and spicy.  Some of the chips unfortunately spent a little too long in the deep fryer for my liking.  I&#39;m picky with chips.  These were unfortunately not the perfect balance of crispy on the outside soft on the inside.<br><br>OVERALL<br>Decent burger place.  Was debating between a 3/4 star during my meal.  Last minute save by the delivery boy.  As I left I saw him hop on one of their awesomely decorated delivery bikes.  <a href='http://www.yelp.com.au/biz_photos/7Dp_kuCO295Neo2oRxjuoA?select=ta7XzREoxqKSIsror7Q5Gw#ta7XzREoxqKSIsror7Q5Gw'>yelp.com.au/biz_photos/7…</a>  Love the environmentally friendly nature of the delivery.  Well done!",
