"rating":"3.5",
"reviewcomment":"I had a grudge against these guys for a few years, lol. I went in there 3, 4, 5 years ago? I ordered a soup on one of my low carb kicks and asked for no noodles, just extra veges if you don&#39;t mind. Never a problem anywhere at the million Asian places I&#39;ve asked for the same substitution at before and after. I probably even had it at Happy Chef a time or two before! But no, no... that day, I found the Asian Soup Nazi who was insisting on charging me $2 extra, lol. I was like, piss off, I&#39;m not having a soup here then. <br><br>And I stayed away for YEARS!!! :)<br><br>If I&#39;m honest, they make good food here. Someone else described the decor as a little hospital-like. Yes, its white and sparse and dreary. No frills. It&#39;s not a place you sit and hang out. You have a cheap meal and then go about your business on  King Street. <br><br>The wontons are a little flavourless, to nitpick. But pretty much anything you order will be good. The seafood here is always super fresh, plentiful and you get big, fresh, plentiful prawns in your soup... I have to give them kudos for that (are you listening Gazebo, bloody wankers).",
