"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/7D-gOJkSnGo21WOlMKtNfw/l.jpg",
"rating":"3.5",
"reviewcomment":"One of Sydney&#39;s original healthy eating restaurants, Iku has been serving up its famous rice balls and wholesome casseroles, soups, salads etc since 1985. This is true soul food, and you can taste every bite of an Iku meal regenerating cells killed by booze and nachos and restoring an overall sense of well-being. Yes I realise how wanky that sounds but I don&#39;t care, it&#39;s true! <br><br>Iku is macrobiotic has always used only organic and where possible, local and seasonal ingredients, and if you like your food fresh, wholesome and nutritious you don&#39;t need to look much further. Another thing I appreciate here is that Iku always used to seem quite expensive to me as a struggling student, but as the kind of ingredients they use have become more readily available the prices haven&#39;t changed that much over the years, meaning that you can spend under ten bucks and get a decent meal.",
