"rating":"4.0",
"reviewcomment":"Easily the best brunch spot in Newtown... And that&#39;s not just because Newtown is completely lacking in the brunch scene, it&#39;s because Vargabar is absolutely adorable and damn good! <br><br>Right off King Street, yet tucked away into darling Wilson Street, Vargabar is an &#34;open-air&#34; style place that&#39;s all about sustainable food and delicious coffee. They roast their own beans, known as &#34;The Marilyn,&#34; which have picked up some street cred in the coffee world. Their caps are therefore great, and they also have delicious frappes and frozen specialty drinks that they serve out of, what else, mason jars. <br><br>I&#39;ve only ever had the pan baked eggs, which while a bit expensive, were undeniably fresh and a refreshing flavour combination: a tortilla covered in melted cheese, mushrooms, mango chutney, cheese, and more, it was a filling breakfast that you definitely didn&#39;t walk away feeling guilty about. <br><br>They also have wi-fi, which is fantastic, making it not only the best brunch spot, but in my opinion, the best computer hangout spot, in Newie.",
