"rating":"3.5",
"reviewcomment":"I met a group of mates at House and had a lovely meal. FOr a team of 9, we ate like kings and only ended up paying $20 a head for he food (drinks were extra and purchased form the pub next door). On price alone, it was 5 star. <br><br>I wasn&#39;t comepletely taken by every dish, but that probably says more about my tastes than the quality of the dishes. Case in point, I like larb gai. I like larb gai A LOT. We also tried the same dish with duck, and while most others thought it was better, I disagree. <br><br>Curries were tasty, stir fries were delightful, and the company good to, but for some eason I was left a little disappointed.  <br><br>I&#39;ve heard a lot about House.... It is one of Sydney&#39;s favourite Thai restaurants, and it has a staunch following. I&#39;m not here to buy into the Sydney House vs Homevs Chat Thai vs SomeOtherPlace debate, but I wasn&#39;t convinced it was the best Thai I have ever been to. I would go back, especially with a large group, but I have enjoyed Thai more elsewhere.",
