"categorystrlist":"Spanish",
"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/f0BAFm6R8Sl8OG74EI8YzQ/l.jpg",
"rating":"4.0",
"reviewcomment":"My friend and I had just returned from Barcelona and felt the need to dig into the closest thing we could find to Catalonian cuisine. I&#39;d been to Movida in Melbourne, loved it, and figured that much couldn&#39;t go wrong when playing from a tried and tested playbook. I was not wrong. <br><br>We rocked up about 1pm on a Friday afternoon and grabbed a seat at the bar. Started with Iberian ham which was just as good as we remembered. We then had pig cheek with scallops and cumquat marmalade. Jiminy Cricket! So, so good. Last, some duck leg with pickled cabbage. Also a treat. <br><br>What was great about Movida was their detailed level of knowledge about the food and wine. I was at a cafe in Newtown the previous week and they couldn&#39;t even tell us whether a cake they were serving had nuts in it! At Movida, the staff had very specific knowledge about everything on the menu. A brilliantly sublime Friday afternoon.",
