"rating":"4.0",
"reviewcomment":"Wow, that&#39;s a good chai latte - with the thick sweetness of eggnog and a nice layer of cinnamon on top.<br><br>But it&#39;s the the oatmeal cookies with filling in the display that will blow your mind. Not only are they delicious, the cookies have a range of flavors that slowly reveal themselves one after another while you chew. Not the sort of fine-dining experience one normally has vis-a-vis the humble oatmeal cookie! <br><br>High quality ingredients are on offer here, and it certainly showed in their $8 protein shake - which was very nice (as it should be), and I&#39;m curious to try their homemade juices.<br><br>Lots of other interesting things on the menu to try, but what I had so far, the cool staff who make you feel like you&#39;re just having a snack at a  friend&#39;s, the cozy wood feel, book-lined walls, and super laidback vibe of this place are already reason enough to come back.<br><br>On the meh side, while the bread for their tuna sandwich was really good, the sandwich itself was solid, but just ok. I would have preferred if the mayo were mixed with the tuna rather than just on the bread.",
