"reviewcomment":"Here I was on a work trip to Sydney...and my friend had scored a reservation for 4 at Seiobo.  I&#39;ve never eaten at an esteemed Momofuku before and was so excited.  Two of my friends are married and have a little girl, so we were actually 5 but the nice staff made accommodation for us; not that she was going to have the prefix but they just asked if she could be cool during a long adult meal.  Which she did. <br><br>The food was spectacular.  What can I say?  I&#39;ll upload a host of photos for you to see for yourself, it&#39;s about as good as it gets.  The preparations were just fantastic. I would have liked things a tad more crazy/adventurous but thats just me.  Oh! They also offered drink pairing, 1/2 pairings (which is different from the full pairing), and juice pairings (which is also awesome to see).  <br><br>I wouldn&#39;t say it&#39;s a once in a lifetime sort of thing because if I lived in Australia, I would have been back by now.  Come in good company and just sit back and enjoy the food and conversations and awesomely chill vibe.",
