"reviewcomment":"Omg pastizzi!!!! This place is a god send when hungry, drunk, craving a snack, craving carbs, salt and fat. For only $1.60 you get a piece of pastizzi which is a golden, flaky pastry with warm gooey yummy filligs such as chicken,  bolognaise,  peas, cream cheese,  tandoori chicken, etc, etc. At any time of the day, even if they only have 5 kinds on display,  they can magically pull out any of the many flavours on the blackboard out of thin air!<br><br>When you eat the pastizzi, its serioisly heaven. The crunch from the pastry is just deafening and will make your chewing as loud as Lily&#39;s loud chewing from How I Met Your Mother. <br><br>If you&#39;re on a budget, I recommend you go to this store as you can get more from your budget constraint here, all other stores charge $2 or $2.50. Looking at the price differences, you could profit from these price differences by buying from the crown street store and selling the same pastizzis for an amount between 1.61 to 1.99 in front of the oxford Street store. You could do this everday until, they either made the prices the same between stores or they chase you away with an angry maltese grandma with a broom.",
