"reviewcomment":"Coffee: Mecca (Dark Horse Blend)<br>Passion: 10/10<br>Crema: 10/10<br>(Top 10 in Sydney)<br><br>Coming to a cafe and getting schooled on what a coffee can do in the right hands is a wonderful thing. Having tried the Colombian single origin from Mecca before I made the mistake of bad mouthing it here, and was then delivered a fantastic coffee. Since then, I know that when I come here I&#39;ll be served by someone with the passion to squeeze the best out of the beans.<br><br>Today I started with a El Salvador Grand Reserve espresso which, in the words of Shoji &#34;just tastes like coffee&#34;. To be honest.... it did... It was robust, it was smooth, it was a whole lot of coffee, but it still kept something for the end. While not cutting through the aroma or the full body, as the flavours developed in the after-taste, a lighter, somewhat nuttier flavour appeared. Very enjoyable.<br><br>I then grabbed the filter coffee of the day which was an Ethiopian Duromina. which started with an amazing spicy aroma, somewhat citrusy. As it opened up however, the flavour started to degenerate and leave a sour after-taste. While not a bad coffee, it was no where near as good as the El Sal.<br><br>All up, this busy cafe is a brilliant representation of what Mecca beans can do. And by all accounts, that is a good thing indeed.<br><br>N.B.<br>There is #powerwhoring available inside towards the coffee bean display.<br>No public WiFi available.<br>Single origin coffees are always available",
