"reviewcomment":"Maybe it&#39;s the red and white checkered table cloths or the Itallian waiters but there&#39;s a certain charm about Casa di Nico which makes me feel like a i get a small taste of Italy here in Sydney. It&#39;s a sweet restaurant but not overly friendly for vegeterians.... <br><br>We shared a few dishes to start , but my favourite was the  Zucchini Flowers  Stuffed with Fetta and Olives, with Semi Dried Tomato Dipping Sauce - it was yum - but warning it does cost $20.... (a bit too pricey I thought)...<br><br>For mains we struggled..... craving a pizza we decided to go for the Margherita as there were no other vegie options - which was super disappointing.... not the pizzza - the pizza was good but the lack of options was bad...we also shared the pan fried gnocchi - which was quite yummy...<br><br>I kind of wish restaurants like this would allow Vegeterians to have a few more choices.... not everyone loves meat.",
