"reviewcomment":"For me, walking into Sepia evokes memories of fashionable Manhattan. The atmosphere and the decor take me back to another lifetime ... all that before you even think of food!<br><br>From the outset you will notice that service is low key yet attentive and impeccable. Make it a weekend visit (booked in advance) so you can treat yourself and that special someone to Sepia&#39;s degustation menu crowned by their signature dessert the chocolate forrest.<br><br>The menu is well balanced, ranging from subtle flavours to big ticket items that seem to pop with a firework of flavour. The menu changes over time, but it&#39;s always a journey worth taking. There is a reason why Sepia is both loved and awarded.<br><br>I would suggest a very light, if any, breakfast or lunch on the day of your visit as the degustation menu builds and is overall very substantive.",
