"rating":"4.5",
"reviewcomment":"Gimme a D!<br><br>Gimme an O!<br><br>Gimme a P!<br><br>Gimme an E!<br><br>What does that spell?<br><br>DOPE!<br><br>This place is DOPE! Outfitted in a warehouse conversion, this place is bustling on the weekends...in a good way. There&#39;s plenty of space so the ambience is real cool.<br><br>Service is great, everyone was super friendly and everything came quickly. I ordered the Bullhorn (I don&#39;t even like feta) and my friend ordered the Merchant. I like that they some of the menu items are standard in other places but they put their own spin on them. However, there are these fusion naan sandwiches (which I haven&#39;t seen elsewhere) that I am putting on my to eat list.<br><br>The coffee was on point and props to the barista for the latte art.<br><br>The menu here is extensive enough that I will definitely be coming back to try the other stuff. <br><br>Gourmet brekkie done right.",
