"ogurl":"http://www.yelp.com/biz/cafe-shenkin-erskineville",
"categorystrlist":"Cafes",
"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/otNaDpjhsTl5oWZuGT8U-Q/l.jpg",
"rating":"4.0",
"reviewcomment":"This is one of our favourite spots to take people who are after a cafe experience with a difference. The Israeli food they have is amazing and each time we come we have our &#39;go to&#39; dishes that are sure to please.<br><br>Try the Shakshuka with eggplant &amp; haloumi. The signature Shenkin wrap is definitely a must. Their felafel is possibly the most authentic I have had. Be warned though, you may not want to have several close quarter discussions after eating here or just be sure to bring some mints ;)<br><br>They use Mecca dark horse as the house and will have some nice single origins from time to time. Baristas are well trained and I know that they strive for excellence in their coffee as they have changed blends a few times in the years I have gone there. Coconut hot chocolate is a must try. Hot chocolates are not my drink but I will crave this one from time to time. If you&#39;re after something cold, the frappes they serve will hit the spot or have a freshly squeezed juice.<br><br>The venue is surprisingly deep so don&#39;t be fooled by the front entrance as there are plenty of seats in the back of the cafe with some great big share tables and a sun light which is lovely during the day.<br><br>Atmosphere here is good, service is always high and the owners are almost always here which gives it that added touch of a small business doing great things.<br><br>So if you are after a great lunch go to, a taste of Israel or something different to bring some visitors to then Shenkin comes highly recommended!",
