"rating":"4.0",
"reviewcomment":"For a grocer to be open 6am - 8pm in Surry hills, it&#39;s a great start. This family run friendly italian grocer is a true realisation that good customer service still has a place in this uber-cool super busy, online purchasing world. <br><br>You&#39;ll walk in to see a range of fresh fruit and veggies, and a barrister serving beautiful Campos coffee, to the left are 3 tightly packed isles of imported deli style food, including award winning olives, oils, dried fruit, vinegar&#39;s, the list goes on. <br><br>For the sweet tooth, they serve fresh gelato&#39;s and ice creams - all home made, and fantastic. For the busier customer, take to work some great home-made sandwiches, salads, or dried meats. <br><br>Although the prices can be a little steep in comparison to a supermarket, it&#39;s worth it for the imported and hard to find fresh cheeses, meats, and great service you get - ask for a taste test, and you&#39;ll know why.",
