"rating":"4.0",
"reviewcomment":"First of all - no surcharge on credit cards. Anyone who does this is just bloody smart.<br><br>Second of all, getting greeted on arrival is essential, but being offered drinks orders straight up, sitting at the bar and having access to the menus is just sublime. Makes me feel like I am in NYC. Well, in a good restaurant in NYC anyway.<br><br>So, if you&#39;ve heard of Heston Blumenthal, the way this place serves food has that kind of bend to it. Its stunningly delicious, enough that I&#39;ve been back twice. It changes menu occasionally, so you probably want to get there quickly for the pork textures. <br><br>Yes, you read right. Pork. Textures. So. Good.<br><br>Servings are not huge, up front. But the thing is, they keep on bringing out these little dishes, like amuse bouche, that just keep on stacking up in your belly, and they are well presented, its almost a shame to eat them. Don&#39;t worry, the shame doesn&#39;t last long.<br><br>Go here. Now.",
