"rating":"4.0",
"reviewcomment":"We must have been going to this place for over 10 years, but this is the first time I&#39;ve had a chance to to Mohr in about months. While the fish available changes daily, the menu as a whole hasn&#39;t really changed in the last decade- and that&#39;s not a bad thing.<br><br>Sooo there&#39;s a menu, but basically what you do is you pick:<br><br>1. A Fish<br>2. A Sauce/Topping (eg. hollandaise and asparagus or avocado salsa or cajun crust)<br>3.A Potato (eg. chips or gratin or wedges or gnocchi)<br><br>and order that. 90% of the time I get the tuna, with avocado salsa and chips)<br><br>There is very limited seating, but the turnover is quick and high. Just give your name or number when you arrive and pop over the Shakespeare Hotel for a drink. They&#39;ll come drag you out or phone you when your table is ready (normally about 1 drink&#39;s wait).<br><br>P.S. the tartar is tangingly perfect.<br>P.P.S the chairs are all stools, so don&#39;t wear a short skirt<br>P.P.P.S if you like your tuna pink, as for RARE not medium rare.",
