"rating":"4.0",
"reviewcomment":"Be still my cirrhosised liver, softly my gaseous intestines, go gently clotted heart.<br>I knew this would happen, I promised to review Sydney&#39;s Laksas but I cant tell the damned difference. After two mouthfulls I go into a feeding frenzy like a demented shark and I only pause to consider flavour and other characteristics when the bowl is empty. <br>Then I have to make something up about the experience because I was out of body at the time and my actual body was inhabited by that cartoon Tasmanian Devil with a spoon and a pair of chopsticks.<br>I recall there were actual curry leaves and from a photo I took I can discern seafood. The flavour was beautiful - the kick was nothing like Malay Chinese Takeaway but at least this time I dont need a snow cone instead of toilet paper, and I still have my lips.<br>So the score so far<br>Sedap 10<br>Malay Chinese Takeaway 10<br>Jimmys Recipe 10<br>Wong Kee 10 <br>Noodle City 10<br>Truth is - I have no idea what I&#39;m doing, I just love Laksa.",
