"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/6hRH6dEe7NUAwAUpDGAGQA/l.jpg",
"rating":"4.5",
"reviewcomment":"Loved it.<br><br>I&#39;m transiting through Sydney en route to home (Virginia, USA). Looked around for some good Italiano before flying tomorrow, and found this gem via community reviews.<br><br>It&#39;s a bit confusing to find, for starters. Almost an unmarked for in an alley, but do press on.<br><br>I dined alone, but the wait staff were wonderful. They didn&#39;t hover or make me feel either freakish or unwelcomed.<br><br>Started off with a glass of prosecco and the prosciutto di San Daniele with &#34;gnocco fritto&#34;. Odd, but sure. The gnocco are basically pasta noodles quick fried. Not oily, but certainly fried. Strange, but it worked.<br><br>For my secondo piatto, I had tagliatelle in a spicy tomato sauce (almost an arrabiatta) with capers, blanched spinach, and shaved parmigiana cheese. Paired with a rosso delba from Sicily, it was fabulous.<br><br>I rarely get dessert, but the orange sorbetto with Campari called me. Not a big fan of Campari, but the combo worked. Paired with a simple grappa biancha, the dolce was just right.<br><br>Really glad I followed the reviews. Henceforth, I will plan a &#34;Sydney staging night&#34; whenever I&#39;m heading home from biz trips, and Berta is a MUST stop for me. Thanks!",
