"rating":"4.0",
"reviewcomment":"AUSSIE IN NEW YORK<br>Just wow! one of the best assembled breakfast I had in a long long time. Everything is right about this meal, great ingredients that compliment each other and most importantly the flavours were balanced too. The level of attention to detail is high, small pieces of red onion and picked white onion give that tangy hit. Bagel is soft but has that dense bite to it with a crispy outer shell. The cream cheese on the bagel is just heavenly on its own and of course the salmon that tasted pure and fresh.<br><br>JUST EGGS WITH A SIDE OF SAUSAGES<br>Simple dish but every element on the plate is presented and cooked to perfection. Great sausages and yolk porn moment guaranteed.<br><br>BANANA SHAKE<br>Delicious shake great alternative to a hot beverage. Natural tasting that makes you wanting more.<br><br>Conclusion<br>Creative bistro that seems to be experimenting and updating their menu seasonally. Great combination of quirky dish names, accessible location, friendly service and delicious seasonal dishes makes this one of the best all-day breakfast/brunch style meals in Sydney. Ten times better than overrated Baroque at The Rocks.<br><br>@thesydneynoob",
