"reviewcomment":"First impression of this place is that it&#39;s very simple.  First off when you get in,  no one will entertain you,  but that&#39;s not a bad thing though lol. You just have to pick you&#39;re order on the computer near the entrance.  That for me, seems very cool, only few restaurants has that. <br><br>About their food choices. They don&#39;t have lots of variety of food choices on their menu.  It&#39;s not a typical Japanese restaurant with all those sushi and stuffs. They have a few varieties of noodles and bentos and some small stuffs too.  On the front counter, they have another varieties which are not included on the menu. <br><br>Food taste.  Well I ordered a salmon bento.  First I notice is the hot miso soup with it.  It&#39;s very tasty,  but the rest are pretty good too,  I liked what I ate. <br><br>Space and seats.  Space is alright for a small group of peoples that&#39;s it. They only have few chairs too.  So yeah. <br><br>Parking.  The parking is just depends on the situation.  You can park on the nearest parking station or park on the street. Just to let you know it&#39;s just beside Paddy&#39;s market so when it&#39;s busy it&#39;s difficult to find a parking.<br><br>Oh and yeah the toilet.  NO TOILET so if you need to go then you better go run to Paddy&#39;s market.",
