"reviewcomment":"Two Black Sheep has been my coffee destination for close to two years during which they have been constant brewers of coffee, toasters of bread and superb customer service providers. <br><br>I&#39;m not a coffee monogamist- I&#39;ve been known to change my coffee order from the occasional skim latte, long black, soy cappuccinos and even the less frequent California special (decaf, soy cappuccino no chocolate).This gives me I think a bit of knowledge and authority to say that Two Black Sheep coffee is consistently roasted well, crema is silky and hot  and chocolate is always generously sprinkled.<br><br>Already winners of several best of Sydney awards these kiwi brothers have put their hearts into their business with extreme attention to detail and an emphasis on quality.<br><br>10 Reasons Why 2 Black Sheep Rock Town Hall:<br><br>Customer coffee cards with cute sheep to rack up coffee credits<br><br>Amazing coffee beans and coffee done the way you want it. extra hot -&#34;no worries&#34;, super weak- &#34;totally and without judgment&#34;, triple shot it -&#34;we understand&#34;<br><br>Great customer service with happy barista ninjas that are extremely fast<br><br>It&#39;s the place to be and be seen on a Monday morning<br><br>Two dualling espresso machines on the go<br><br>Brasserie bread for hearty toast in the morning<br><br>Adam and Dave have authentic kiwi accents<br><br>Eco &amp; socially conscious vibe and attitude<br><br>Sheep t-shirts<br><br>3.5 words: cheese &amp; tomato toasties!!",
