"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/v2huduYrLY0EIHVR3eq8LQ/l.jpg",
"rating":"3.0",
"reviewcomment":"A nice location and a relaxed vibe, but the food? Meh it&#39;s ok I guess. <br><br>It&#39;s your typical burger joint (which is a good thing) with a bit of a South American influence. I went straight for the burger menu and picked out the gaucho burger and a 4 pines hefeweizen to go with it. <br><br>The gaucho has a dry aged Angus and wagyu beef patty with chimmichurri sauce, lettuce, cheese etc. It&#39;s also billed as &#39;some like it hot&#39; with a spicy patty, chilli and hot pepper sauce. I liked the tang given by the spiciness, but don&#39;t get too excited spice lovers, I&#39;m notoriously soft when it comes to spice so if I can handle it it&#39;s not that spicy. <br><br>My main issue though was my burger was just too dry, maybe this was the patty I ordered, maybe it&#39;s healthier cooking style? Whatever it was though I missed those flavoursome juice/sauce you get in a good burger. Oddly the dryness also extended to the bun. <br><br>I like the idea of this place and it does a job, I just wish the burgers were a bit tastier.",
