"rating":"3.5",
"reviewcomment":"First time here and didn&#39;t really have much expectations except good food and good service due to the area it&#39;s in - hippy Surry Hills. <br><br>Service wise not too shabby, although the waiter said it was a 5 course Omakase meal which turned out to be 6. Also couldn&#39;t really hear what they were saying when introducing the dishes. <br><br>So here&#39;s what we had:<br><br>1. Trio Entree: Tofu with apple, mandarin and prawn, Chicken with sweet chilli sauce and (epic) seared scallop with raw salmon and teriyaki sauce<br>2. Mullet Sashimi with Fish Roe<br>- Sashimi Trio: Tuna, Kingfish and Salmon<br>- Prawn and Squid Salad with cucumber, carrot and bean sprout strips on sweet soy dressing<br>- Grilled Swordfish<br>- Sushi Platter<br><br>The highlight was definitely the seared scallop and the rest are quite normal - something you can order elsewhere. There was also the option of having matching sake (it&#39;ll def overwhelm the plain flavours of the fish) but we choose the normal set. I did have the Kirin apple cider though @$14 .. so expensive! <br><br>Will I do it again? Yepssss and this time will order dishes from the a la carte! <br><br>p.s. Loved the interior design!",
