"rating":"3.5",
"reviewcomment":"Sometimes you have to have Asian cuisine and after a few weeks in the land of Oz, I was in dire need.<br><br>The funny thing about Chinatown in Sydney is because of the amount of &#34;eat and runs&#34; that happen, you order and then you have to prepay... That was something we learnt fast when the server looked at us awkwardly after we ordered...<br><br>This was the only place open early enough for breakfast too and it was good!<br><br>We had the tofu soup, green onion pancake with egg (because egg screams breakfast), Xiao long bao (soupy dumplings) and seaweek salad. It was super good.<br>The meat in my dumpling could have been a little bit leaner but being Asian food deprived for so long, I was willing to chow down.<br><br>They had a great menu. I&#39;m sorry I didn&#39;t get a chance to try a few more things while I was there...<br><br>The set up is nice. They have this kind of old temple feel to the exterior. They also have red lanterns that they have hung on the outside. I just don&#39;t approve of water down your condiments. I had a bowl of vinegar by the end of it because it was so weak!<br><br>Now I kind of want to fly back for breakfast....",
