"reviewcomment":"Main tip for this place - plan in advance and book a table! This place is great for groups, but apparently books up early. My friend and I turned up at about 7pm on a Wednesday and all tables were booked for the night, so we made to huddled at the bar.<br><br>I don&#39;t mind the bar, so this was not a drawback at all for me, and it meant we were close enough to the waiter to order our margaritas (they have quite the variety and make them well)... and actually, speaking of margaritas, they also have a really good tequila collection. I don&#39;t actually remember the last time I saw such a good collection of good tequila (if you&#39;ve only ever done tequila shots you should at least once try good tequila, and for the love of all that is good please don&#39;t just shoot it!)<br><br>The Mexican food was quite good, we had the fajitas, and I was pleased to see that before we even ordered we were given a side of chips with salsa. We ordered the plate for two, and it was more then enough food for the both of us.",
