"rating":"3.0",
"reviewcomment":"Cruise Bar is a great stop for a reasonably priced meal with a stunning view or a cheeky little after work beverage with someone you&#39;re sweet on. <br><br>I went to Cruise first on a date. It was a Friday night and I was fairly new to the city. My suitor chose the spot and we met in front of the Contemporary Art Museum. I remember it being particularly balmy and me being equally nervous, so I was glad the walk to the restaurant was a short one. I could have easily ended up in a puddle of hairspray and makeup on the Circular Quay walkway. <br><br>We grabbed a seat at one of the high wooden tables out on the patio facing the magnificent Opera House. The drinks were decent and the conversation was alright, but I couldn&#39;t help feeling like vibe was magical. Don&#39;t tell my date, but I was actually busy lusting after Sydney itself. It&#39;s beauty and charm, especially from that sparkly vantage point, stole my little beating heart.",
