"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/iluax1mfZQhl9Zlua7Q1lg/l.jpg",
"rating":"3.0",
"reviewcomment":"Had a fasted blood test across the road and then wandered in here STARVING, since I walked past the other day and spied the breakfast menu, which seemed rather good. I thought, why have I never eaten here before? Otherwise, had I not been STARVING (seriously, I was hangry) I wouldn&#39;t have risked the mediocre cafes here and walked straight to any one of my Marrickville favourites down the road, hehe.<br><br>I had the salmon with poached egg and corn fritters. Breakfast was lovely. Lots of salmon, a perfectly poached egg, lots of spinach, some fresh and some lightly blanched. Good coffee. <br><br>My coffee took longer than expected to come out, but then my food took over 20 minutes. It was 20 minutes from when I started counting! The place was empty - one other table filled. The service was inattentive, but my waitress was nice enough when she spoke to me. The chick behind the counter was pretty surly.<br><br>It&#39;s a great location, very central and unmissable - right on the point where Enmore Rd and King Street meet, but otherwise unremarkable. Maybe this is why it&#39;s unremarkable? Places with a location like this don&#39;t have to try very hard to get your business.",
