"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/bqL1o4Bj_KHkgzhzlKipTw/l.jpg",
"rating":"3.5",
"reviewcomment":"My wife and I stopped in to this little cafe for lunch today after walking across the harbor bridge and had a great experience.  She had the lamb burger, which was perfectly prepared and extremely tasty.  The burger had lots of feta cheese and a real unique use of egg plant that perfectly complemented the other ingredients.  This was all served on a delicious, crusty bun and with a big mound of delicious chips (french fries).  She also had an ice coffee with her meal, which was outstanding (served like a milk shake, with whipped cream on it). <br><br>I had the fish and chips, which came with some chips and a really fresh and tasty salad consisting of mixed greens, onions, and tomatoes. The fish was three large pieces, each of which were perfectly battered (not too thick or too thin) and extremely tasty.  <br><br>Service was fast, friendly, and efficient.  Prices were very reasonable.  Indoor and outdoor seating was available, and it was really quite pleasant outside. Folks were reading and snacking, or having a glass of wine, and just hanging out. We would definitely return and highly recommend trying this place out for lunch or a quick snack.",
