"reviewcomment":"Nestled in a quiet street in Paddington just off the bustling Oxford Street, The London is one of my favourite pubs in the area. Whether you&#39;re there for the big screen to watch whatever match might be on, or just there to chill out and have a couple of beers, this is an ideal venue. The front bar area has a number of high tables with stalls while out the back there is a small garden area and another indoor area - this one with low tables and seats. <br><br>The pizzas are pretty damn good here too, my most recent outing there seeing me try the prawn and chorizo ($22) - didn&#39;t need any help finishing it (and not because I&#39;m a fat b*stard). They&#39;re a bit pricey, but nevermind, they&#39;re good! As long as you like your thin and crispy pizzas. There&#39;s plenty of other menu choices if you&#39;re not in a carb mood. I&#39;d highly recommend this as an establishment to pop into if you&#39;re in the area!",
