"rating":"4.0",
"reviewcomment":"If you like a good simple baguette you&#39;ll like this place. If however, like me, you like plentiful amounts of delicious meat, coupled with an equally delicious cheese in an awesome roll you&#39;ll LOVE this place. <br><br>Encasa Deli is a great lunch option in the CBD. While it&#39;s not in the most glamorous location it is nicely fit out and inviting. There&#39;s a small deli with ranges of cheese, chorizo and hams but the main appeal here is the Boccadilo&#39;s. These are fairly minimalist baguettes but those few fillings are amazing. <br><br>I went for the Canario (roast pork leg, queso fresco, roast capsicum mojo and tomato). The capsicum &#39;mojo&#39; and the tomato are mixed in with the pork so it&#39;s essentially just flavoured pork + cheese. I say &#39;just&#39; which definitely doesn&#39;t do the roll justice, the pork was juicy and flavoursome, the lightly salted baguette good and  the cheese probably the highlight which took the roll to another level.<br><br>I&#39;ve already got my eye on the calamari roll or chorizo roll for my next visit.",
