"reviewcomment":"Passion: 8/10<br>Crema: 8/10<br>Coffee: Golden Cobra<br><br>Sure if you start from central this cafe will give you a great work out with the hill to get here, but you&#39;ll be rewarded once you arrive with comfortable seats, good food and good coffee.<br><br>The coffee they use here is Golden Cobra, which is an awesome option for cafes looking to avoid the industrial flavours of the more generic blends, while still maintaining a great, robust (works well with milk) profile. It is unfortunate that they don&#39;t offer single origin coffees for black drinkers, but it is an understandable business decision.<br><br>At $3 for an espresso and $3.3 for a flat white, they are still at the very affordable price end of the spectrum.<br><br>They also have a #powerwhoring spot in the table right in front of the till.<br>(Via BitterBliss - <a href='/redir?url=http%3A%2F%2Fbitterbliss.com%2Fdictionary%2Fbangbang%2F&amp;s=47115ae8ba70eaac77341d01839fcbb8022a99fe35c0bf63014166dffb3bc82e' target='_blank' rel='nofollow'>bitterbliss.com/dictiona…</a> )",
