"reviewcomment":"Went to yum cha here for a work lunch on the recommendation of couple of real yum cha enthusiasts. I can see why they raved about the place. I have eaten yum cha a lot. It&#39;s one of my favourite ways to eat out. This was one of the best I have been to.<br><br>Big selection of dishes. All the usual ones plus a few I hadn&#39;t seen before (mango sago FTW!).  Everything tasted great. Their rice noodles with prawns were great - fried rather than the usual steamed and with a really nice XO and peanut sauce.<br><br>We ate until we couldn&#39;t. Best of all, the prices were very reasonable. The 8 of us stuffed ourselves and got out of it for under $25 each. <br><br>Will definitely be going back.",
