"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/Py2ouPzKE5b8SVefBa0EBg/l.jpg",
"rating":"3.5",
"reviewcomment":"A smile goes a long way... a smile along with a &#34;hi! How are you&#34; and a great cup of coffee goes ALL the way! <br><br>I&#39;ve never ordered coffee from Luxe without some kind of nice interaction with the staff and leaving with a really yummy brew. If I&#39;ve stayed to eat in, food has been fresh, beautifully presented and delicious. <br><br>It gets pretty busy here (because they&#39;re so reliably good!), so be prepared for a little wait. I like that despite the line and the fact they&#39;re busy, I&#39;ve never felt like I&#39;m being rushed or that anyone is too busy to make it a nice cafe experience.<br><br>In terms of ambiance, there&#39;s probably a bit to be desired... but they&#39;ve done a great job with the space they have and it&#39;s definitely a great addition to the Westfield complex!",
