"rating":"3.5",
"reviewcomment":"&#39;Sweeten thy soul&#39; is the motto of this cafe. Tempt me no more. I&#39;m a regular here. San Churro is the undisputed king of thick, dark and gloriously rich hot chocolate, made from an authentic Spanish formula. If you&#39;re not in the mood for a hot beverage, enjoy an authentic chocolate shake or a refreshing frappe (which literally means &#34;to chill&#34; in French!).  <br><br>The taste plate is a must order if you&#39;re dining in a group of two or more. Share a fondue platter or chocolate tapas-a delicious, indulgent arrangement of churros and little chocolate cakes, served with melted gourmet chocolate and ice-cream.<br><br>From the individual treats, I recommend the Strawberry Bizocho- a wonderful blend of chocolate cake, strawberries, chilled custard and milk chocolate. Take some truffles home to enjoy later.",
