"reviewcomment":"YAY ! My 100th REVIEW !<br><br>This gem in Surry Hills was introduced to me by my buddy and I love her for that !<br><br>LOVE LOVE LOVE....why?<br><br>Reason #1 - Value for money<br><br>Considering how expensive dining out in Sydney is, it is often difficult to find a restaurant that serves good food with reasonable prices. SUSHI SUMA DID IT !<br><br>The set dinners are good for 2 people (guarantee that both of you will leave the restaurant with smiles on your face!) and it costs less than $40 ! (without any drinks) How awesome is that? <br><br>Reason #2 - Good food<br><br>Agedashi tofu : Tofu is lightly battered and deep fried , served with the warm soy-based sauce, YUM <br><br>Sashimi : Take a bite and you know it&#39;s fresh. <br><br>Tonkatsu - YUM YUM<br><br>Reason #3 - Service<br><br>Service is FAST. This helps especially if you were starving !<br><br>The negatives include 1) Tables are slightly *too* close to one another. It is difficult NOT to hear the conversation at the table next to you 2) The couch seat is kinda worn out....hence not very comfortable to sit on. <br><br>Highly recommended , two thumbs up !",
