"reviewcomment":"Ricky Ocambo use to own Carabella a Spanish restaurant that specialised in tapas, paella and other Spanish regional dishes.  After a 3 year break he has returned with Ricky&#39;s cafe under the bridge.<br><br>Ricky&#39;s claims to have sourced the best suppliers of organic food and the perfect sourdough which is a great combination of crusty and sour sourced by a French artisan.  Another artisan creates the exquisite pastries seen in Ricky&#39;s.  <br><br>The coffee is perfect for the purists and for the foam milky lovers like myself.  Jams are interesting too with flavours like Strawberry and Pinot Noir and Rhubarb and Rasberry.  The honey is from Piedmonte in Italy but I have yet to indulge in a jar.<br><br>We have been at Milsons Point at 7am and still have not managed to get seating but its on the cards every weekend to beat that crowd and enjoy the food treasures we have only observed while waiting in line for our takeaway.",
