"reviewcomment":"Wow wow wow what a surprise this place was.  A really yummy find.  I dont normally like a too heavy meat meal but I&#39;d happily eat here every day!<br>Went there for dinner last night with my boyfriend.  For starters we had criolla and pollo empanadas and they were sooo delicious they set the whole evening off lovely.  For mains we had a grill plate with rump steak, pork neck and chicken thigh.  Its worth noting that I am a very plain eater and very fussy with meat.  I thought I would only eat the chicken but the rump steak was absolutley the winner.  And the chimichurri that goes on top of it... Hmm salivating thinking about it.  <br>We got Papas estrelladas as a side dish and being Irish I have high potato standards :)  they did not disappoint.  Drink wise I had a sangria and he had a litre of argentenian beer.  We skipped dessert.  We were so glad we found this place.  The staff were great; attentive without being overbearing. And the atmosphere there was lovley.  Fun decor too with some really great old photos about.  I will definitely be back!",
