"categorystrlist":"Pubs,         Music Venues,         Pub Food",
"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/4Ou3zVmJDhHNv0I7UWDW9w/l.jpg",
"rating":"3.0",
"reviewcomment":"The Landsdowne is an iconic pub on City Road opposite Victoria Park at Broadway. Clientele range from locals, tradies, uni students and people following the live music scene so emo kids, punk rockers and heavily tattooed heavy metal fans along with those dressed entirely in black - (not to be too specific, trying to paint a picture here!) Another great live music venue just check the schedule online so you don&#39;t turn up wanting melodic indie tunes and end up with heavy metal. Or vice versa.<br><br>Upstairs is another bar, bistro and courtyard/deck, with seriously cheap food. Like $7 steaks and whatever the current equivalent may be. The menu is actually organised according to price, with $7 meals, $10 meals, $12.50 meals or wait, step back, $16 meals. With most pubs in the area and their swanky bistros, $16 would be considered cheap. Not at the Landsdowne, serving up pub meals the way they are supposed to be served - with lots of change left for beer.",
