"reviewcomment":"Holy. Cake. <br><br>I&#39;ll admit it, I went in for a savory snack (it&#39;s tough to avoid this picturesque cafe on Queen Street), but was immediately diverted by the large window of cake. It practically reached up, smacked me around, then hugged me in a warm, buttery embrace. And I couldn&#39;t get enough. Seriously, I picked up three (THREE!) slices of cake to take away - the gluten-free almond orange cake, the lemon-lime tart and the tiramisu. Okay, so I also got a soft, almond finger biscotti dipped in chocolate. <br><br>Let&#39;s be honest  - I was completely blinded by their dessert science, so don&#39;t expect this to be a balanced review by any means. But if you&#39;re looking for cake, Zigolini&#39;s cake will make you want to shove as much as you can straight into your face and take the bits that can&#39;t fit and rub it directly onto your skin.",
