"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/t4JiwyimaGB5aB5YE3-YvQ/l.jpg",
"rating":"3.5",
"reviewcomment":"Great location. Love the layout of the main floor: sandstone walls, with a clear view into the open kitchen. Despite a good amount of tables and other patrons, the place was not noisy.  <br><br>The service was outstanding, but not overbearing. Staff were there when I needed them but didn&#39;t pester me. <br><br>Food was a mix of amazing (pork belly starter $18.90 - best I&#39;ve had), really good (chocolate mousse cake with chili ice cream), to really good after seasoning (300 g rib eye surf and turf $39.90 and 400 g NY cut striploin for $42.90).  Both steaks were tender and cooked to perfection - but just calling our for some salt and pepper. <br><br>Their beer selection was limited, but good quality. I had two Mexican beers I hadn&#39;t tried before (Day of the Dead - both a blonde and a Heffe for $9.90/bottle). <br><br>Honestly, if the steak had been seasoned a bit before hitting the grill, this would be a 5 star review, but it just wasn&#39;t there. Sorry, Dan, it&#39;s another 4 star from me.",
