"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/enkBFJAXpiN4A6i3rwMAhw/l.jpg",
"rating":"3.5",
"reviewcomment":"I was searching for lunch in Balmain and wandering the streets when I heard the word &#34;Reuben&#34; and was stopped in my tracks. While in NYC recently I had fallen in love with these pastrami filled beasts with their oh so tender and flavourful meat *drools*.<br><br>So when I started enquiring inside about if the sandwich was served on rye bread, I noticed to my dismay that they used.corned beef and not pastrami .... :-(<br><br>But... I had already sat down, and still needed lunch, so as is my way, I ordered their burger. I had intended as a backup plan to try their kransky hot pot special, but it appears it had already sold out. AND THE BURGER WAS DELICIOUS!!!<br><br>Next to the mass of thin fries (that were so plentyful I could not get through them all) was a burger consisting of a juicy burger lavished with bacon, cheese, caramelised onions and plenty of love. Even the bun was awesome, giving me good purchase as I demolished this amazing lunch item. Even thinking about this burger now just makes me drool...<br><br>I them finished off the meal with a nice little mac. It was pretty damm nice (though not as good as the burger...). That said... it was still one of the better cafes I have found in Sydney, and so well worth checking out if in the area.<br><br>Cafe Summary<br>------------------------<br>Passion for Coffee                - 7/10<br>Coffee beans                        - Morgan&#39;s coffee<br>Crema (1=burnt, 10=velvet)  - 7/10<br>Special coffees avail?           - N/A<br><br>Special Features<br>------------------------<br>Toilets",
