"reviewcomment":"Breathtaking views and great service sums up this place!  My husband and I wanted a round of drinks with a view, and we were initially placed at a table in front of the bar.  When a table opened up closer to the windows, the waiter suggested we move to it to enjoy the views.  Though I took ample pictures and managed to sneak in a corner of sunset in my photo album, I started to learn the rotation of the platform was making me dizzy.  Even the shadows of objects on the ceiling were making me uneasy.  I has to turn my back to the windows and not look at the ceiling...or really much of anything.  I don&#39;t normally get this type of disequilibrium, so keep in mind it&#39;s possible for anyone.  But even if this applies to you, it&#39;s worth it.  It&#39;s a very touristy thing to do, but you have to do it once.",
