"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/W2atWc7APdDIyBFBlJ8jfw/l.jpg",
"rating":"4.0",
"reviewcomment":"I&#39;m sorry, who do I talk to about getting wagamama in California? I&#39;ve known about it for a very long time (I swear on my life there was one in NYC but I can&#39;t seem to dig up any info on it) and was excited to learn that there was a location immediately next to my hotel.  So, one rainy evening, I walked over to have some ramen and beer.<br><br>I wasn&#39;t overly concerned with authenticity as I&#39;ve seen in a couple other reviews, I just wanted to go to a wagamama and eat some ramen.  It wasn&#39;t very crowded so I found a spot right away.  I ordered the Chili Beef Ramen and an Asahi.  Both came out quickly and the ramen hit the spot.  It was flavorful, very spicy and warmed me up.  The cold beer was the perfect complement to wash it all down.<br><br>I decided to treat myself to dessert.  I wanted to try the Lychee ice cream, but it didn&#39;t come with a wasabi chocolate sauce like some of the other dessert options had.  My waitress though was gracious enough to give me a side of the sauce, at no extra charge, with the ice cream.  Have you ever tried Lychee ice cream with chocolate wasabi sauce? Probably not, cause I&#39;m pretty sure I&#39;m the only person that&#39;s done it, or at least I&#39;m going to claim that.  But you should do it cause it&#39;s UH-MAZING.<br><br>Please Wagamama, please expand beyond your East coast US locations!",
