"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/1xRI-WJjn9ciE5LO9njScQ/l.jpg",
"rating":"4.0",
"reviewcomment":"As a native Floridian, I have quite the heart spot for seafood ... Lobster, clams, oysters, fish; if it swims or floats, I&#39;ve probably tried it. Even sea cucumbers. <br><br>Peter&#39;s Fish Market is the most bustling of all the seafood shops inside Sydney Fish Market. Depending on the day, I can be enticed or turned off by crowds, but on this day, the wrap around line of salivating patrons seemed to scream &#34;Join us ... no, really!&#34; The wait was long, about twenty minutes to order and fifteen to pick up the food, but it was peak lunchtime mayhem on a glorious summer day. And after one bite of my fish and chips, I can say that I would&#39;ve waited even longer.<br><br>The fish was PERFECT and moist, the breading was light, and the chips were delicious! For around $8 I experienced the best fish and chips of my life, and the portion given was huge! I sat on the grass just outside of Peter&#39;s, revelled in the sunshine, treated my taste buds, and sipped on cheap wine the people next to me were willing to share.<br><br>Try Peter&#39;s ... It&#39;s divine!",
