"reviewcomment":"Great pizzas - some are gourmet and non-traditional, and some are rather traditional, but they&#39;re all fab. We shared the goat cheese and pumpkin and, I think a more traditional one with mushrooms? They also have gluten free bases. <br><br>Hugo&#39;s, if you haven&#39;t been is very sceney, swish, la di da duckface trendy, so if you&#39;re not into that, skip it. I sometimes am, sometimes I&#39;m really not. I&#39;m a bit of a chameleon. It&#39;s whatever. You can definitely get a great pizza at a more casual, pizzeria type place than Hugos in Darlinghurst. <br><br>I like Hugo&#39;s cocktails, so while they&#39;re pricey, they&#39;re good. They still do the best Amaretto Sour in the city (however, they&#39;re better upstairs in the Lounge). I am sooooo starting my fancy cocktail diet... TOMORROW, lol.",
