"reviewcomment":"I would rate two Italian restaurants in the city, Machiavelli and Intermezzo (the &#39;newcomer&#39;). <br><br>Machiavelli is the old classic and it has been around since the late 80s and it has seen politicians, business men and everything else in between. I&#39;m sure many political and business plots were hatched here ;-)<br><br>A classic touch is added by the Italian meats and salamis hanging in the centre of the room and you will meet those meats and salamis again on your antipasto plate. The stuffed zucchini flowers are and absolute delight and chicken soup is the perfect dish for me during the colder months.<br><br>Their pastas are delicious and I am a fan of their Saltimbocca, make sure you try it!<br><br>The service is impeccable and if you need to impress old or new business associates, this is the perfect spot.",
