"rating":"4.5",
"reviewcomment":"I can still smell the dark, wickedly non-bitter and very very moreish chocolate..... *drools*... Why? Because I could not leave the store without buying some. :-)<br><br>On the hunt for yet another cafe, I stumbled upon a store front that almost seemed boarded up with news clippings and other laminated articles, and if it was not for the &#34;Chocolate&#34; that caught my eye, I may have missed out entirely. The shop maybe quite small, but it is packed with so many varieties of deliciousness that you&#39;ll be hard pressed to choose.<br><br>I decided that I should try to find the ultimate match for a couple of the smoky Islay single malts I have at home. The desire therefore was to find something 80+% cocoa solids, giving a rich comparison to savour the smoky peat. At this request I was presented a sample of the perfect dark choc. Within seconds I had found what I was after.<br><br>Not to stop there I was then presented a sample of tobacco chocolate which contained heavily caramelised cocoa which was then mixed in with 60% choc. The result was a crisp, almost nutty result which while delicious, was not as good as the 80% I then purchased.<br><br>No this is not the cheapest chocolate you will find, but it has to be close to the best in Sydney. I would certainly recommend them if good quality choc is what you are after.<br><br>By the way, they also serve Sacred Grounds coffee here which I can not review as I did not drink any here, but you might want to should you drop in.",
