"rating":"3.5",
"reviewcomment":"Economists will always say everything is relative. So as my Mexican is quite limited to gyg, mad mex and the old el paso super market packs, it may or may not be reliable!<br><br>I do live to California burrito company! after eating mad mex for weeks, as mad mex is amazing, even of its starting to taste the same, I decided to try the California burrito company on my walk home. Let&#39;s just say I really should go there again next time I have a burrito craving.<br><br>The burritos are firstly huge, like I mean it gives the mad mex 1kg burrito a challenge in size, so come for hunger pangs. Secondly, the burrito is really really tasty, each bit of the burrito tastes different from the last, it&#39;s something I&#39;ve only experience here. Thirdly, the menu is bigger and there&#39;s more to try.<br><br>Burritos are a little more expensive, however, you do get more. Hope to walk into this little orange store again sometime soon! Come here is gyg and mad mex are starting to taste bland. I think this is what real Mexican should be like!!",
