"rating":"4.0",
"reviewcomment":"If you work in the Sydney CBD near Martin Place, it is highly likely that you would have eaten a Little Vienna sandwich. No matter which one you get, its all so delicious. I have a craving for one as I write this - and its only 7am in the morning! Italian grilled sausage on brown vienna bread, here I come!<br><br>Although there are 3 branches in the city, they are all located within one city block which is kinda weird. The Pitt St and Barrack St stores are less than 150m of each other! But all of them are super busy during weekday lunch hour. <br><br>My recommendations? Apart from the Italian sausage, the grilled chicken and the poached chicken breast are particularly good. The obligatory chicken schnitzel is ok, but not as good as Via Abercrombie. You also get to choose the type of bread...and you have to get either white or brown vienna. Oh and the foil-wrapped sandwich is huge! You&#39;ve been warned...<br><br>If you haven&#39;t tried Little Vienna, get yourself to one quick smart. The PItt St branch is particularly cosy and they also do a great banana bread &amp; toast in the mornings. Love this place!",
