"reviewcomment":"Beppi&#39;s is one of my favourite restaurants in Sydney and defiantly the best Italian restaurant in the East.  <br><br>There are two parts of the restaurant to dine in, the front has a modern finish and the back part of the restaurant is set in a wine seller. <br>I prefer the wine seller area as it adds a great vibe to the whole Italian dinning experience.  <br><br>The menu is amazing and the waiters know there wines - be sure to ask for a recommendation on a nice bottle of wine to compliment your dish selections.<br><br>The restaurant holds a lot of history as its been open for 57 years and it has a authentic Italian feel. <br><br>After dinning at Beppi&#39;s several times, I would have to say my favourite is Fiori di Zucchine ripieni con Ricotta e funghi Porcini for a starter Spaghettini verde con coda di Aragosta, pomodoro fresco e basilico for the main. <br><br>I highly recommend dining at Beppi&#39;s and if you have the chance, try the cheese plater after your man meal.",
