"rating":"2.5",
"reviewcomment":"Ah. Wafu.<br><br>So I&#39;d heard about Wafu, and then I was heard it was closing the weekend I was in Sydney. Fortunately it turns out my friends are members so I was able to get a &#34;reservation&#34;. Inverted commas because when I said this, I received a fifteen minute lecture that she doesn&#39;t take reservations. And that was after thirty minutes of not being acknowledged.<br><br>It&#39;s hard to rate a place like Wafu, five for the experience, one for what you feel the whole time whilst there and anywhere between a three to five for the food itself and ... I don&#39;t even know what for the &#34;entertainment&#34; you get.<br><br>Even though a lot of the principles of this place are aligned with my own personal beliefs, I won&#39;t lie - I felt on edge the whole time. The extreme nature of things also makes it a little hard to take seriously without become condescending.<br><br>In good news, the food was good. But, how good? Because my friend finished my leftovers the next day and asked where I went for dinner because it wasn&#39;t all that great.",
