"rating":"4.5",
"reviewcomment":"May&#39;s King Prawn Laksa (bee hoon) is the best I&#39;ve had in Sydney. And if that doesn&#39;t get your salty, spicy, creamy, noodle soup, ON.... they have at least a dozen different variations of meats, noodles and broths including a smashing Asam Laksa for the hardcore spicy fish soup lovers amongst us.<br><br>The Chicken Rice is all kinds of &#34;I&#39;ll have what she&#39;s having&#34; goodness. You will think an alien just teleported your a$$ to Singapore and back. Then you will silently wander  back to your cube with a huge dopey smile on your face and change from a 10er in your sky rocket.<br><br>Apparently there is loads of other good stuff to eat at May&#39;s but unless I eat there 3 days a week I will never find out.<br><br>If you haven&#39;t discovered the joyous wonder of Laksa or Chicken Rice yet, there is little hope for you. But any hope there is, you will find at May&#39;s.<br><br>As for the enlightened rest of you, don&#39;t walk, RUN TO MAY&#39;S for your next North Sydney lunch appointment. But do it before 1pm because their Laksa and chicken rice is so good, they generally run out by 1:30.",
