"reviewcomment":"I think I got too worried after reading the Yelp reviews. I was practically shaking in my shoes while I was waiting for my turn (and it took a while, too, there being a line and everything). I was rehearsing my order over and over in my head, anticipating a talking-to over Not Having My Order Down Pat.<br><br>I needn&#39;t have worried. The owners are a bit gruff, and not overly effusive, but they were nice enough. In fact, the two girls behind me, first-timers as well, struck up a conversation with them.<br><br>I ordered a toasted sandwich - salami and cheddar, with lettuce and tomatoes on brown bread. Salami and cheddar went on first, toasted til the cheese melted, then lettuce and tomatoes after. Grand total: $10.50.<br><br>Not gonna lie, the toasted sandwich was good -- better than the toasted sandwiches I make myself, heh -- but didn&#39;t seem as good value for money vs. the other large sandwiches I&#39;d seen being constructed, which I think came out for around the same price. Oh well! There&#39;s always next time. And I&#39;ve taken a copy of the menu with me, so now I&#39;ll know Exactly What to Order.<br><br>This place is a bit hidden -- you&#39;ll have to go into a small lane off Elizabeth Street, and the facade is pretty plain. If you spot a line during lunchtime, that&#39;s probably it.<br><br>==<br><br>Edit: 24-Feb-14<br>So I went here again, and I ordered a ginormous sandwich this time. Brown bread + chicken schnitzel + fresh tomatoes + lettuce + mayo came to $13. This sandwich was HUGE... I couldn&#39;t finish it in one sitting, and saved the other half for the next day.<br><br>I came at 1 PM and the long lines were gone -- there was only one guy ahead of me. The wife wasn&#39;t there, but the husband was, and he was really nice, even wishing me a nice weekend after I paid.",
