"rating":"3.0",
"reviewcomment":"We came here one day for lunch. I was with my coworkers who had eaten here previously.<br>First thing I noticed was how small the area to dine is. During the lunch time it is rather busy and crowded, the seating is not terribly comfy (I assume this is why people tend to shuffle in and out rather quickly). <br>I ordered the Thai Basil Chicken, my coworkers ordered the #4 Savory Roti as an entree (this is an appetizer to those of us from the US) and the spicy Thai fried rice. Mine was the first one to come out, then the fried rice dishes and then the Roti. Everything was a nice portion, and tasted good. The staff was pretty attentive for being so busy. <br>I feel like this place could be more easily enjoyed in the evening when it isn&#39;t as busy for them. But once again the seating isn&#39;t the most comfortable unless you get lucky enough to get one of the booths.<br>The food was good and it was moderately priced, I will most likely try it again before I leave.",
