"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/ZLetYiMAqIPdEWLgFG4gMw/l.jpg",
"rating":"3.5",
"reviewcomment":"Walking along George Street, you pass by several food establishments. I was on a hunt, looking for somewhere that sold kangaroo meat. Lo and behold, Oz Turk Pizza and Kebabs had a huge chalkboard sign in front of their store with the word &#34;kangaroo&#34; in large font. And it was just around the corner from my hotel too!<br><br>I walked in on a Wednesday evening, roughly past 9pm. The place was empty and unbearably hot. I couldn&#39;t imagine how the people working here don&#39;t suffer from a heat stroke. Although Oz Turk has an extensive menu including pizza, kebabs, pastas, salads, burgers, etc, I skipped browsing the menu on the wall and asked for a kangaroo burger with chips.<br><br>For my first time trying kangaroo meat, I was quite impressed. It wasn&#39;t as gamey as I anticipated, and it tasted a little bit like beef. The meat was so tender and juicy I almost forgot how dry and stale the bun was. The thick-cut chips were fresh, not overly salted, though borderline undercooked because the center was a little grainy and chewy.<br><br>Service was quick and friendly. I appreciated how my burger and chips were made fresh, because the pizza slices under a heat lamp all day didn&#39;t look so appetizing. Oz Turk is open 24 hours a day, which seems to fit nicely on the George St scene.",
