"reviewcomment":"Chill Café is quite far down King Street and could therefore almost be classed as off the beaten track, which is almost how the locals see it anyway as it&#39;s a great place for them to linger and catch-up without too much hustle and bustle. This brooding feel is aided by the deep red that the shop is painted in, the customers come here to lurk and nurse hangovers with big cups of coffee and a paper. <br>For those in the mood for something more substantial there is a tantalising menu of quite sophisticated twists on typical bar food such as a steak sandwich or Portugese Chicken burger all of which comes in satisfyingly huge portions. There is also a chalk board of specials behind the bar which is always being updated to keep the regulars coming! <br><br>There&#39;s a real homely feel to this place and with such a friendly service and relaxed atmosphere I&#39;ll most certainly be hobbling along here on a Sunday morning again!",
