"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/G_41UNgkYPbidMisHVW64w/l.jpg",
"rating":"3.5",
"reviewcomment":"Old school Italian. This is one of the oldest Merivale restaurants (which tend to turn over every few years). We came here for the Easter Weekend on a whim after a couple of other places were booked out. It is a lovely venue, which faces out to the Pool Bar. Now, on a Saturday they had a set price of $100 for 3 dishes and $150 for four, so we went the $100 and I ordered hare ragu with tagliatelle as a starter and lamb shoulder as main. It was incredibly tasty and I highly recommend either dish. Wait service was excellent and attentive and the wine list is, frankly, awesome. Pinot noir&#39;s from Mornington Peninsula make me so happy. The only downside was that pascha (some nightclub thing) was held in the Pool Bar as well - which Uccello faces, which meant it was very noisy and people were smoking, Otherwise this would be a great five star. By the way, having pascha there also means random dancers which was amusing. You can solve this by simply seating further back in the restaurant rather than close to the pool Bar. Lesson learnt!",
