"rating":"4.5",
"reviewcomment":"OK, so this review might come a little weird, because I didn&#39;t have any beers, but I&#39;m off to convince y&#39;all that yes, even if you decide not to drink beer here you can still have a rockin&#39; time.<br><br>I went here on a Wednesday night to meet up with some friends. The place was a bit empty except for a few people here and there. We settled in an area near the entrance, which was cozy and quite comfortable accommodated a group that ballooned to around a dozen people.<br><br>If there&#39;s one word for the place, it would be that: cozy. Lights dimly lit, oak decor (it IS called Redoak, after all), with the sound a comfortable level -- not quiet enough to make it seem dead, but not noisy enough that you have to shout to make yourself heard.<br><br>I ordered:<br>OVEN ROASTED BARRAMUNDI FILLET $28<br>- sustainably farmed Barramundi, char-grilled asparagus, baby cos leaves, heirloom tomatoes, grilled haloumi cheese<br>and it was really good. I wanted something else but convinced myself that I needed to get something &#34;healthier&#34; than what I originally wanted. This was really tasty so I didn&#39;t regret my choice. :P<br><br>Service was also pretty good, with the guy at the counter helpfully offering me his advice when I was thinking about what to order.",
