"reviewcomment":"Walk along Pitt Street and you&#39;ll find one of the terrace houses with the signage &#34;The Fern&#34; out in front.  It&#39;s pretty rad when you think that this was built as a house but now used as a cafe/restaurant.  <br><br>The Fern is a wonderful place to get some work done as you can sit in a booth (don&#39;t sit too long though as sitting in a booth will make your tooshy uncomfy after some time) with convenient powerpoints located inside.  They&#39;ve got free Wi-Fi you can connect to and the staff is pretty chill (and by staff, I mean the guy that works there) who doesn&#39;t mind that you&#39;re there doing your thing.  The food is quite alright too so when you can eat lunch and do work, it&#39;s a bonus.<br><br>I&#39;d definitely love to just come here and hang out (sans laptop) at night, have a few drinks, and see what the vibe is like.",
