"rating":"3.5",
"reviewcomment":"Give these kids the presidential medal of freedom, or whatever our dinky Australian equivalent is. <br><br>It&#39;s 7.30am on a Saturday morning and raining like someone up there thinks we&#39;re Brisbane in a flood year. There&#39;s also a line of tetchy, sketchy, crabby people out and about on this godforsaken day wanting sustenance and coffee, hot coffee, to get them through to the afternoon. And this is a weekend. Can&#39;t imagine what weekdays are like. Well I can, I just don&#39;t want to. <br><br>The coffee is stupendous. I could barely open my eyes and my mind was a fug, but even in that state I knew good coff-coff when I Taste-d it (eh? eh?). Also, their bacon and egg rolls are just marvelous - you know when you get one greasy, filmy egg and one Lilliputian rasher of bacon in a roll that would leave a toddler hungry? These were the antithesis to that, big damper-style flour-topped rolls stuffed with at least 5 or 6 rashers of juicy bacon and fresh eggs. And there&#39;s a deal where a cofee &amp; B&amp;E roll is just $8.00, or $10.00 on weekends.<br><br>Is it sacrilegious to call these chaps saviours? Because they are. And I don&#39;t care who knows it.",
