"rating":"3.5",
"reviewcomment":"I was lucky enough to finally get lunch here the other day.<br><br>My first visit was take-away sushi rolls which were amazing, but rich.<br><br>The breakfast for me was a total miss; greasy pancakes that weren&#39;t anything to write home about. And my mother&#39;s toast was a very thin, unsatisfying serve.<br><br>However, my sit-down lunch? Exquisite. Unbelievable. Amazing. I had a spicy tuna dragon roll - cooked tuna, a spicy red mayonnaise and avocado. It was mind-blowingly delicious; and the spice added a taste (and heat!) rather than just being there to make it hot. <br><br>My mother got the sashimi salad, which was also exquisite - fresh sashimi (tuna and white fish), crisp salad with avocado and the most perfect dressing ever.<br><br>We both had the panna cotta for dessert - has to be one of the best - if not the absolute best - panna cotta I&#39;ve had. It was as light as a cloud, and the berries and fruit were so fresh and delicious.<br><br>It was a beautiful meal, and had so many different choices on the menu that I will definitely be back (but only for lunchXD)!",
