"ogimage":"http://s3-media4.ak.yelpcdn.com/bphoto/wwEgurgCvJariVrxz3pdVQ/l.jpg",
"rating":"4.5",
"reviewcomment":"I wouldn&#39;t have known about Yokozuna if my friend, Viv (shout out!), hadn&#39;t pointed it out to me. It&#39;s definitely a hidden gem and easy to miss as you head towards Taylor Square down Oxford. <br><br>Ambiance:<br>-Yokozuna&#39;s a small, sort of hole-in-the wall sort of place. No thrills -- just a long corridor of a restaurant with the kitchen at the back<br>-Next to a porn shop -- make sure you enter the restaurant and not the shop upstairs. Talk about awkward.<br>-Authentic - when we arrived, there were a couple of tables with Japanese patrons. It&#39;s always a good sign when people who know the food are eating it.<br><br>Food:<br>-First off, this place is BYOB. So, already good.<br>-We started with Gyoza - cooked and plated in a way I&#39;ve never seen before. The gyoza are still connected by their skin and you have to break them apart. Delicious crispy morsels. <br>-We then followed up with salmon avocado rolls, fresh salmon sashimi (they ran out of the other fish by the time we arrived - I took this as a good thing. I&#39;m glad they want to keep things fresh), this amazing tempura mushroom dish, lemon chicken, and a toro kama.<br>-The tempura mushroom dish was definitely yum. Crispy, chewy, and juicy all at once, drenched is amazing ponzu sauce and fresh cut onion.<br>-I&#39;ve had the privilege to try kama (fish neck/collar) at a few places in Japan and San Francisco.Yokozuna was able to deliver here with their toro (tuna) version. This one dish was what pushed them over to 5 stars for me. Succulent, flavorful, fleshy fish. Grilled through to perfection. A must try - esp. for those who have never tried kama before :) <br><br>Need-to-know:<br>-Yokozuna is family run. So you literally have the father, mom, and son working in the kitchen and giving full TLC to the food you order. Their daughter is the waitress. Due to this, service is low on resources and slow. <br>-Do not come here if you&#39;re hangry (hungry + angry) or in a rush. Rather, enjoy your BOYB and relax. Dishes will come.<br><br>Let&#39;s just say, we were so happy with our meal, we tipped. I can&#39;t wait to come back and try more assortment of fresh sashimi - bought straight from the fish market.",
