"reviewcomment":"The Star in comparison to The Crown is still a far way but at least they&#39;re trying to get some good food in the door. You have Sokyo, Momofuku, Balla and Black on the one side and you have the foodcourt style on the other side like Ding Tai Fung and Ribs and Burgers. <br><br>Had the chicken breast to be safe (red meat dishes like beef and pork could either be overcooked or undercooked) so thought you can&#39;t go wrong with chicken breast right? Yes I was right. Usually cooked chicken breast are very dry but these ones (that look like the map of Australia) was damn juicy and flavoursome. The only thing that was annoying was it&#39;s served on a wooden board. Not that I have anything against chopping boards, but the sauce was dripping all over the table and had to clean it up - I&#39;m responsible like that!<br><br>Oh and the chips (big fan) are crunchy too! They have this pink sauce - all the sauces are FOC (free of charge) - and was quite interesting when you have it with the chips. <br><br>Try it yourself!",
