"reviewcomment":"What can you say about Cafe Jolly except that it is weird, but nicely weird. It&#39;s run by Chinese and it serves Italian food and some of those Italian meals have never been served in Italy.<br>Like Chinese dishes, many of the meals on the menu have made up names but the food is good - the combinations are a little strange but they work.<br>At night it&#39;s always busy but the waitresses run around serving food always smiling, I love it. You can have a meal or just a cup of coffee, you can sit inside looking out opened windows or you can sit outside with the hustle and bustle of Norton St.<br>I love it for its eccentricity, it&#39;s great.",
