"rating":"4.0",
"reviewcomment":"We went to Sugaroom on a Ouffer voucher. Despite being rather difficult to find (around the corner once you get to bottom of Harris st) we were warmly welcomed on a rather miserable night. <br><br>The set menu had a tea smoked salmon starter but they also offered an (off menu) onion tart as an option- which was delicious! The salmon starter was light and fresh.<br><br>Mains gave the option between a filet of beef and gnocci dish and a fish (breem) dish. Both were superb. We weren&#39;t expecting much from the fish but its was a rather pleasant surprise.<br><br>Desserts were a chocolate creme brulee with marshmallows and rasberries. And a passionfruit pavlova of sorts. Both again were real tasty!!<br>On the vouchers were a bottle of wine between 2 too. <br><br>Overall, an absolutely delicious meal, in a great and beautiful location right on the water (despite it being a rather miserable night we went on), with excellet and very attentive service. My only concern would be the prices of their full price/ a la carte menu (based on their prices on their website). The portions were generous and really scrumptious but did seem a little overpriced.<br><br>All up though, HIGHLY RECOMMENDED!",
