"reviewcomment":"I don&#39;t mind this place for a drink and a chat - it isn&#39;t too loud and is quite spacious. There are some lounges by the big open windows and there are a few seats on the sidewalk as well. During the week, they have live music one or two nights a week, nothing too heavy which is good if you&#39;re just chilling after a long day at work.<br><br>The place does get packed and rowdy on Friday and Saturday nights when the people from the burbs come in. The stench of stale beer and vomit is quite off putting come Sunday morning/afternoon.<br><br>The bistro is popular here and the food is pretty solid - decent enough pub grub although a little pricier than average. <br><br>There is a pokie room down one end which is separated from the rest of the pub, a bit of an escape really! The servers that tend to the pokie room are quite sociable.",
