"rating":"4.0",
"reviewcomment":"Ever had the Dry Horrors so bad you don&#39;t think you&#39;ll make it through the morning?<br><br>We&#39;re talking Ragnarok in your head, the sour whisky sweats, a tongue like a dead skunk. You can&#39;t hold a conversation, and have no idea how you&#39;ll make it through the morning without keeling over and dying somewhere awfully public.<br><br>That was me a few weeks back. Then I stumbled upon the honey-fried chorizo sandwich with avocado and chipotle mayonnaise sandwich at this corner cafe. Eating it was like the flavour-filled fountain of youth had welled up inside me, rejuvenating my busted organs and wan skin with delicious, life-affirming goodness. Far out. My new go-to hangover assassin, right here.<br><br>Also good? The corn fritters smothered with chipotle (you gotta ask for that) and tomato and avocado salsa, and the fat hash stack, with a poached egg on top and jacked with buttered spinach and corned beef. <br><br>Inside can get a little hot and sweltery, stalk one of the breezy pavement tables but be warned, they&#39;re hot property.<br><br>Cash only.",
