"rating":"3.5",
"reviewcomment":"Slow service, but otherwise excellent.<br><br>An Australian/Indonesian friend took me to this Indonesian restaurant on the edge of Chinatown for lunch.  Beautiful classy interior, with a semiprivate room for the two of us.  <br><br>We started with the Lumpia Mangkok, a half-an-eggroll size crispy cup-shaped pastry, filled with stir fried vegetables, with a mince prawn on top. Accompanied by a dip of garlic-based chili sauce.  This was the best item we had, with lots of flavors and the contrast of the crispy pastry.<br><br>Then we had an Indonesian style chicken curry, with a nice thick rich sauce.  Deep fried fish fillets with a sweet and sour sauce, that were fried but you could still really taste the fish.  A nice side of lightly cooked vegetables.  And white rice.  .<br><br>We ended with Indonesian white coffee and some watermelon.<br><br>It was an excellent relaxed meal, in an environment that would work for business luncheons, family get togethers, or outings with friends.",
