"reviewcomment":"When I made the decision to have a lazy Friday night in, I did not expect to end up at New York Slice at 1am, along with the Kings X drunks, ordering pizza in my trackies.<br><br>I dont blame myself for this, nor do I blame NY Slice.<br><br>I blame American TV shows. <br><br>It didnt take long from watching &#34;Louie&#34; opening credits before the TV was paused, the key was in ignition, and we were on a half hour journey to appetite satisfaction. And not wasting this moment, we of course invested in a whole pizza to bring home, nested in the most humongous pizza box I have ever seen.<br><br>NY Slice has crispy, thin based pizzas that are not drizzling over with oil. Lots of toppings to choose from that so far have not disappointed. I still have yet to find a pepperoni pizza quite as good. <br><br>You are sure to enjoy but dont expect seating as its a small shop with a 1 table capacity (and possibly done to fend off the drunken antics. Well played, NY Slice).",
