"reviewcomment":"Cheap all you can eat buffet Korean bbq is not something you usually go to and usually cheap places with buffet or all you can eat have lower quality ingredients for you to cook from.   <br><br>This place is quite ok considering its cheap price. The price is cheap being $21 for dinner and being able to eat as much as you can but with a time limit of how long you can stay (during busy periods). I have been here a few times in the last couple of years and recently a few weeks ago. When I go here I think it&#39;s usually packed even on a Monday night.   <br><br>The food they have here are good enough and good for the price you pay. And of course it will depend on how you cook it as this is a bbq place. I find the quality of the meat and seafood quite good but you would get better quality at other bbq restaurant. The grapes they have are good as I ate a lot of grapes after having enough meat and seafood.  <br><br>You would come here if you want to eat a lot and to pay cheap price for bbq. If you want better quality ingredients to cook from, you would go to other non-buffet places or to more expensive all you can eat bbq places.",
