"categorystrlist":"Greengrocers,         Italian",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/FS8etJvyC3ZmeRtFnwDcXw/l.jpg",
"rating":"4.0",
"reviewcomment":"Fratelli makes me wish I was a rich person. There, I said it. <br><br>Dammit. I WANT to spend $20 a kilo on organic mushrooms. I WANT to spend $3 on imported Italian beans. Just because they&#39;re there, and they look so damn good. Oooo, what about that $7 a pannet of luscious organic strawberries, $15 for a little tub of delectable toasted muesli? (It&#39;s really good muesli) Dammit, those olives look good too. Don&#39;t even let me look at the cheese. Do NOT let me look at the cheese. <br><br>It&#39;s AAAALLLLL good, my friends. There is so much Italiany goodness at this place, it&#39;s overwhelming. I don&#39;t know what to do with myself. Downside: You don&#39;t shop here regularly unless you&#39;re on a very healthy salary. <br><br>I&#39;ve had good customer-service experiences here but a friend of mine has had a bit of a hard time with the staff, who admonished her for not calling them before she arrived to inform them that she was buying a selection of goods to make a &#34;hamper&#34;. This was totally unnecessary, as my friend was arranging &amp; selecting the goods herself, so maybe the staff were a bit control-freaky about it.<br><br>PS: It&#39;s kind of a deli, kind of a green-grocer, and also has a nice place to eat upstairs. If you can&#39;t figure out how to get upstairs, ask someone, it&#39;s worth going up there.",
