"rating":"4.0",
"reviewcomment":"Personally, this is a place of bad omen. I have been on two disastrous triple dates here. Once with an arrogant know it all d-bag and the second quite by accident with an arrogant know it all d-bag who ended up on reality tv. The two other couples though, doing just fine.<br><br>This really is the perfect place though to bring a group of friends or a few couples. The lay out of the tables are such that you can hear and speak to everyone without breaking off into little pockets. <br><br>The service is always super friendly and keen to please. Very helpful when deciding what to get as well. Both times we went with a banquet and we just sat there and picked at our food in dribs and drabs - it really made for a relaxing atmosphere. I can&#39;t recall the prices now, but I do remember thinking that it was great value for the quality and the amount of food that was served.<br><br>I would definitely like to go here again, just to see if I can break my bad luck!",
