"rating":"3.0",
"reviewcomment":"I love Azuma because it&#39;s the place my dear friends at Macquarie Bank, Goldman Sachs and Investec take me when we&#39;re having a catch up in the city... I think they love this place because it&#39;s fancy, exclusive, delicious and close enough to work that they can &#34;get away&#34; without &#34;getting away&#34;.<br><br>I find this place to be gorgeous - simple Japanese decor, Azuma is all about understatement.  All the food is fantastic and if you can afford it, I&#39;d suggest it all...<br><br>Now I know this is a bit strange, but I strong recommend their salts and peppers - that come in an array of colours and flavours when you order the Tempura - in fact that&#39;s a good enough reason to order the Tempura. They add an additional something special to this place which you can&#39;t get anywhere else (highly recommended)<br><br>All the food is fresh, the staff wonderful..... I&#39;m just grateful that my rich banker friends feel inclines to take a struggling artists to such fancy places - i like to call it Karma Offset.",
