"rating":"3.5",
"reviewcomment":"I must be the only person who can&#39;t understand Google Maps. I was originally aiming for another brunch spot, thought this was it, and went in. It wasn&#39;t, but I had a good meal nonetheless!<br><br>I ordered the haloumi breakfast which consists of tomatoes, mushrooms, sourdough bread, and, of course, grilled haloumi. The serving was quite substantial and made for a pretty hefty brunch. Good food, I found it a bit too buttery, though that may have been personal taste. I would come back to try the other things on the menu. It&#39;s the kind of place where you can stay and have a good chat, or read the newspaper and chill out.<br><br>The place was busy on a rainy Sunday morning -- though not as busy as the other more popular brunch places in Surry Hills like The  Book Kitchen and Four Eight Five, which I had originally intended to go to. I ended up sharing the large table (so it didn&#39;t feel too awkward) with 2 girls, which ended up being a couple, who ended up fighting, and that was awkward.<br><br>Service was good. One girl seemed a bit indifferent but it seemed like her indifference was because of newness, she seemed a bit unsure how to handle some things but another girl was more take-charge and kinda directed her with some stuff and handled things quite well.",
