"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/TMWHhIZ9XuCzXssyxhliGA/l.jpg",
"rating":"3.5",
"reviewcomment":"There&#39;s something about the chicken here!<br><br>Been here my fair share of times (as my arteries can attest to) and left satisfied and happy every visit. You may have heard of this place for their amazing rendition of KFC (Korean Fried Chicken). The original fried chicken is crispy and flavourful, as well as being moist on the inside- all without being oily on the outside. I&#39;m sure The Colonel would approve.<br><br>Tried and tested many other flavours but I will say my favourite at this underground eatery is the sweet chilli coated chicken. Red sticky caramel like sauce coats each piece of fried chicken evenly, and every bite hits you with a balance of sweetness and chilli.<br><br>The various hot pots here are tasty and full of what they say they will be full of. Seafood hotpot is packed with real seafood (mussels, pipi&#39;s, octopus) and real flavour (not the powder flavor we&#39;re often subject to). The beef bulgogi hotpot is warming and hearty with a whole chunk of raw bulgogi and plenty of mushrooms placed in the hotpot to cook.<br>If you&#39;re game, you gotta also try their pork bone soup (hyejjanggook). Next level.<br><br>Not the place to go if you&#39;re on a diet. Life&#39;s short- Just go.",
