"rating":"4.0",
"reviewcomment":"One of the first places we ate at in Sydney while we were on our hunt for a place around Darlinghurst.  He actually stumbled upon it after we waited for Bills for about 10 minutes and decided we were too hungry to wait.  Thanks as always to the power of Yelp, we saw this and it fit the bill perfectly.<br><br>It&#39;s a perfect distillation of the Parisian cafe. Low key, unassuming, and the waitress was French too, so it was perfect. We sat at one of the tables that fronts the place, and had a great view of everyone rolling by.  There was even a guy smoking at the table next to us, which might bother some, but I thought it added a little, &#34;je nais sais quoi&#34;<br><br>Anyway, I had a delicious special of chorizo monsuier, and the wife a salad.  Both were fresh, and filling. She had a glass of wine that was on some kind of special, but I don&#39;t remember it being particularly cheap, but she liked it so I shut up.  My baguette was perfect, warm and soft with a perfect crunchy exterior.  Unhurried service, a nice view, and an amazing Gellateria just down the street? European perfection in the heart of Sydney!",
