"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/BWnWc97BwpUViXum89HyXw/l.jpg",
"rating":"4.0",
"reviewcomment":"With a name like this I was expecting some spicy Latin American food, but this place is actually a Thai restaurant. Located near China town on Campbell Street in the city, Chilli Cha Cha is a place thats hidden from the crowds circling dixon and market streets at night. The fact that it was nearly full on a wednesday night however made me feel that this place wasn&#39;t such a &#39;hidden&#39; gem after all and for good reason too. All the dishes that were ordered here were flavoursome, interesting dishes and most of them had quite a spicy hit to them as well, which is probably why this place had the word chilli in its name. One of the dishes definitely worth trying here is the the barbecued meats, so tasty you&#39;ll never want to eat the meat you prepare on the barbie again. The salads here are also mouthwatering and some of them can be tear-jerking and have you reaching for the water and a re-fill on the rice. <br><br>Do yourself a favour next time you&#39;re in the city and by pass dixon and market streets and head to Chilli Cha Cha, just make sure to have a jug of water handy, or if you&#39;re really not good with chilli ask them to recommend some dishes that aren&#39;t too spicy.",
