"reviewcomment":"&#34;Can I grab a coffee to have here please?&#34; Of course.<br>&#34;Shall I pay now?&#34; Sit down and relax. <br><br>Nice way to start an affair with a café, especially on a work day. That&#39;s exactly what I want to hear as I sit down to slog out a lengthy document - better frame of mind and all that. <br><br>That is until the Green Day rock song starts blurring on the radio.  I&#39;m on a pretty quiet street and it&#39;s the last thing I want to here. Ho hum.<br><br>Coffee&#39;s good though. The outdoor area is casual and well shaded by the orning. The leafy tree lined street adds a bit of natural beauty to the place. <br><br>Menu picks:<br>Salt &amp; Pepper Calamari with steakhouse chips and beetroot salad with spicy aioli ($15.95)<br>Chicken and Leek Pie with mash, peas and onion gravy ($15.95)<br>Granny Smith Apple Pie with vanilla ice cream ($10.50)<br><br>Great service. Good coffee. Homey food. Get rid of the radio or at least turn it down.",
