"rating":"2.0",
"reviewcomment":"Ah, it is so refreshing every time I find a restaurant on King Street that isn&#39;t Thai. The name of this place, which loosely translates to &#39;cuddles&#39; in English, is also the nickname for one of Italy&#39;s most famous porn star/politicians.  I&#39;m not 100% sure if this was intentional, but the sexy purple exterior of the restaurant is surely not an indication of a grandma-style Italian restaurant.  Cicciolina is a modern trattoria and pizzeria and tries hard to distinguish itself as such.<br><br>When I went for dinner, my table shared the garlic pizza as a starter.  It was crusty and perfectly garlic-y.  When it came to the mains, I had the pasta marinara with seafood for around $30.  It was pretty good.  The portions were adequate and the food came quickly.  Though the décor of the restaurant is trendy, hip, and modern, the menu itself isn&#39;t particularly avant-garde, and features many classic Italian dishes.  Nothing to rave about, but still satisfying.",
