"reviewcomment":"A steak is just a steak, right? Wrong. For a sophisticated twist on a classic meal, head down to Steersons where you can enjoy the perfect, most tender steak in a stylish venue, boasting arched ceilings and chandeliers, and situated right on the water. <br><br>You can tell how much thought they put into their specialty from the menu which explains the different types of steaks and how they are best cooked. I chose the Riverina fillet steak with bacon and garlic butter, well done ($37.50 for 220grams). Served with my choice of chips, baked potato or mash, it was probably the best steak I&#39;ve had in a while but considering it&#39;s quite expensive, I was a bit annoyed it didn&#39;t come with salad and the mushroom sauce was extra. <br><br>For those wishing to satisfy a whooping appetite for an equally whopping price, try the famous Wagyu rib-eye steak ($69.50) which has been scoffed down by a few boys I know, though I haven&#39;t attempted it yet.  <br><br>Be prepared to spend money but for a succulent steak lunch or dinner in a stunning setting, nothing beats Steersons.",
