"ogimage":"http://s3-media2.ak.yelpcdn.com/bphoto/NliYYQ8LKtxF5qs-A672KQ/l.jpg",
"rating":"4.0",
"reviewcomment":"This fantastic little French café is my favorite recent discovery.  Le Depot is situated in Ultimo, close to the Ian Thorpe Aquatic Centre.  Unfortunately for me, I was late in joining the bandwagon of people that love this place.  It is always crowded!  Perhaps it is just too small, but that just adds to the charm of this place.  The atmosphere can be described as slightly industrial, yet it is dim and cozy as well.  The cafe is furnished with small tables and chairs and a bar and with high stools.  They have a great selection of French on-the-go snacks like baguette sandwiches, a variety of quiches, and some pastries.  All the food here is reasonably priced, something I really appreciate since similar places in Sydney seem to love overcharging for French food.  <br><br>Aside from making amazing coffee, this place has consistently provided me with satisfying lunches.  Try a baguette ($7.50) that comes with different fillings.  I really recommend the croque monsieur or the lamb baguettes.  Le Depot also makes savory crepes.  For some on-the-go indulgence, definitely take home some of their pastries or croissants.  The almond croissant was top-notch (around $4).",
"reviewcount":"5",
