"rating":"4.0",
"reviewcomment":"This surprising little sushi bar belies it&#39;s unassuming look with decent sushi at a decent price.<br><br>I popped past for dinner, and was a little disappointed at the small size and lack of seating space. I think they may have been closing up (just before 8:30), and I suspect this place is more for the lunch crowd then dinner. <br><br>I ordered the Salmon Box (take-away) which was well prepared and freshly made.  I was a bit surprised to see some pieces of Prawn sushi in the box, as I had asked previously what was in there and had been told &#34;Salmon&#34;. Still, the prawns were not bad, although I personally would prefer them without the Japanese Mayo on them. Overall I would say that whilst it was not the best in Sydney it was quite good for the price ($10), and I would definitely return.<br><br>I will finish with the note that there were some outdoor seats, however these had been packed away, so I headed down to the park to eat it under the Harbour Bridge. I suspect if you popped past at lunch you would be able to sit either inside or outside (as one other reviewer has noted).",
