"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/KNI89QzEBW-av72eb_HzbQ/l.jpg",
"rating":"4.5",
"reviewcomment":"In 2005, while visiting Portland, OR, I ate a  raw tuna and avocado salsa called &#39;Guacapoke&#39; that I&#39;ve maintained steadfastly - until now - was the best thing I&#39;ve ever eaten. It was at a Japanese/South Seas fusion restaurant, so I suppose it&#39;s only appropriate that another Japanese fusion chef would be the guy to finally match it. I&#39;m talking about Big Stone&#39;s Aburi Ocean Trout Sashimi, a delicate, warm dish of delicious trout pieces garnished with salty seaweed and dressed with a perfect ponzu. Rarely is an ingredient done such justice - I can&#39;t imagine a better context for that amazing trout.<br><br>And so Big Stone earns its fifth star. The other four come from its warm atmosphere, surprising confidence - the Spanish theme that runs through it somehow feels authentic once you get inside - its service and, of course, remaining, mostly delicious menu. It&#39;s certainly adventurous, and as such it may throw off more traditional palates - the icy-cold tofu in a leaf salad took a while to convince - but when adventure leads to treasure the journey is always worthwhile.<br><br>Such is the journey here. And there&#39;s one easily-answered question that surely redeems Big Stone&#39;s Japan-o-tapas concept, and validates its clever execution: Who the hell out there is too special to wash down a perfect Japanese-inspired creation with a big glass of sangria and a crispy-chewy Churro dipped in cream? Not I. Not I.",
