"rating":"4.0",
"reviewcomment":"I love Yum Cha (or Dim Sim for our US counterparts). I have gone to most of the big name locations in Sydney and I personally love Palace Chinese the best.<br><br>They offer all the standard Yum Cha fare, but excel at a few amazing dishes;<br><br>1) Salt &amp; Pepper Squid - cooked fresh to order, you have to ask them to get you some - but it&#39;s really worth it. As a bonus the waiter that brings you this dish is really nice and probably the only staff member that laughs.<br><br>2) Gin Chong Fun (aka, Fried Rice Noodle w/ Peanut sauce) - you can&#39;t find this dish at every restaurant, but Palace does it and it&#39;s quite good. Marigold might do a better version imo.<br><br>*Protip*: If you park downstairs in the Picadilly Parking lot (entrance on Castlereigh St, near 133) you can get your parking validated after you finish your meal. Just hand your parking ticket in with your Yum Cha card and they should give you voucher.<br><br>NB: We are still unsure about what the spending requirement is for this, but it seems to be that you have to spend a certain amount to get this offer. It&#39;s well worth it as you are already paying for awesome food, why not enjoy free/cheaper parking?",
