"rating":"3.0",
"reviewcomment":"I had come here once before - very hard to find this place as its in a shopping complex and Google Maps on your iPhone led me to some random apartment alleyway.<br><br>Just recently came here for the All You Can Eat Sushi Voucher Deal on a Tuesday night.  It was fairly empty at 6PM, which is probably why they are doing these deals. I saw on the door that they normally do All You Can Eat Sushi for $30 per person.  I got my voucher for two people and a drink each for $39, so pretty good deal.  We had the house white which was surprisingly really yummy!<br><br>They had a set menu but you can pick and choose. Everything looked good - grilled salmon, cooked tuna, kingfish, prawn, katsu prawn, chicken teriyaki - so we just ordered that. Two massive plates came out with a bunch of different yummy rolls.  Some were raw and some were cooked.  We both started noshing down and had to remind ourselves to slow down.  <br><br>Although we were full, we ordered a few more rolls because we wanted to make the most of it.  We got the salmon belly, squid and inari, spider roll and some more grilled salmon. All were very good. I&#39;d say the best was the grilled salmon. <br><br>Good place for sushi at decent prices.",
