"reviewcomment":"Basil pizza and pasta is an Italian pizza and pasta restaurant on King St, Newtown. I really like this place, I went in here with my wife at about ten pm when they were about to close and were really nice and stayed open for us slightly longer than usual. Their garlic pizza which costs an extra $2 when you buy a large pizza was incredibly tasty-I think I enjoyed this more than the pizza itself, crusty, light and full of flavour. The pizzas were good and the staff incredibly helpful to find a tomato based alternative for my wife who&#39;s allergic to tomato paste. The pesto based pumpkin pizza she ordered was great as was my mexican. Great to see a pizza store as well that does vegetarian and vegan options for their customers.",
