"rating":"3.5",
"reviewcomment":"Ripples at Milsons Point will always be my first love, but I really shouldn&#39;t hold that against Sydney Wharf. <br><br>This beautifully designed restaurant has a stellar view (ahem, though not quite as lovely as Milsons...) and is a wonderful spot to escape the hustle and bustle of the CBD. It&#39;s too easy to stroll over the Pyrmont Bridge and around beside the Maritime Museum to Ripples. You may walk a little tentatively down the wharf wondering where the restaurant is, so just keep an eye peeled for the signing pointing the way.<br><br>First timers really shouldn&#39;t go past Ripples famous fish and chips. It never fails to disappoint, especially if you order a side salad to temper all the batter and carbs - or you can even order the fish grilled. The rest of the menu is delicious Modern Australian fare - the mains range from $25-32, and it&#39;s always worth asking about the specials. These guys know how to do their fish.  <br><br>It&#39;s also handy to know that like their sibling across the pond, the restaurant is BYO (corkage =$8 per bottle) and padded out with fun, colourful cushions - all the better to kick back with a glass of wine and enjoy a looooong lunch!",
