"reviewcomment":"Arrived at this authentic Polish restaurant for a friend&#39;s birthday. There was no way I was missing out on dessert this time so I skipped entrees. For the main I wanted to try something unusual and ordered the duck. My first time sampling this dish was a winner-crispy skin and generous, tasty meat!<br><br>Alchemy: conjuring enchantment it seeks to transform base material into gold and to discover a life-prolonging elixir. I didn&#39;t quite feel the magic-the polish dumplings (&#39;pierogi&#39;) were a little oily and way too pricey. Perhaps it&#39;s because the menu does not focus purely on Polish cuisine, but also incorporates Italian dishes.<br><br>What about the dessert? Well, it may not be the best Polish food in town in my humble opinion, but it&#39;s worth coming here for the cheesecake alone...and the friendly owner who  always comes up to say hello, which is a welcome change from many ostentatious venues serving average food.",
