"reviewcomment":"Maggie&#39;s is a lovely place for a filling and quite inexpensive (for Sydney) breakfast. The pancakes consist of three light and ethereal crepes served with a small ocean of maple syrup and a large dollop of softly whipped schlag (cream). The big breakfast IS big and will satisfy all but gargantuan appetites. These two offerings along with a long black for each diner will not make a huge dent in the day&#39;s dining-out budget and assures the diner they will survive if lunch is a bit late that day.<br><br>Situated on the edge of Fitzroy Gardens and the El Alamein fountain, Maggie&#39;s offers a quiet respite from the bustle of Macleay Street especially if a diner chooses an inside table. While a bit more noise filters from the street while seated outdoors the atmosphere at Maggie&#39;s seems to belie its location.<br><br>As mentioned by other reviewers Maggie&#39;s specializes in German-Austrian dishes. Which, to our chagrin and no doubt disadvantage, we have yet to try as one meal out a day for us (as travelers) is the limit and Maggie&#39;s breakfasts are our first choice.<br><br>Service is friendly and items emerge quickly from the open kitchen. But do try the pancakes. You&#39;ll be hooked!",
