"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/T-MTFVHxk9tLuB0eCOG1SQ/l.jpg",
"rating":"4.0",
"reviewcomment":"Did Marrickville ever need this. The gentrification continues...<br><br>Beejays started as just another cafe. Like there weren&#39;t enough coffee shops here now. But it did well, and the young owner was told that an evening wine bar would also do well, so now it does that as well.<br><br>And it does both well. It&#39;s a small space, with a street-facing counter for a quick coffee, a few tables, and a semi-private booth in front; a long corridor past the kitchen and storerooms; and then a small funky courtyard in back.<br><br>I&#39;ve been for breakfast and found it fun and tasty. My salsa eggs, with spicy diced tomato-y bits and salty halloumi, were a fine breakfast. <br><br>I&#39;ve been for drinks and found it very relaxed, and with a big and interesting list of wines (by glass and bottle), beers (imported bottles), and cocktails (2 for 1 Hendricks gin sours? sure!). Shared with some warm spiced olives, and you&#39;ve got yourself a very happy hour.<br><br>We had one incident where coffees were forgotten during a breakfast order, but other than that service has been exemplary: very friendly, and not in a fake way.<br><br>Super neighbourhood cafe/bar.",
