"reviewcomment":"I figured I would like this place being an American....American style food...American style portions, but I was surely disappointed. Not that I expected anything special from Margaritaville, but for the price you pay you&#39;d think it&#39;d be better. <br><br>I had the jambalaya and it pretty much seemed nothing more than cheap fried rice. It was dry and I think I found 1 piece of sausage. The prawns were decent sized and pretty tasty, but jambalaya is all about the rice! A friend had the seafood mac &#39;n&#39; cheese and it was actually pretty tasty. Way too rich for an entire meal, but still tasty. The beer was average price and the staff was pretty helpful.....but it can&#39;t makeup for the dish they claim to be as jambalaya. <br><br>As most places off Darling Harbour, Margaritaville is super touristy. Overpriced and mediocre food at best. I would definitely have a drink or two here, but avoid the food if you can.<br><br>Though we did see someone order the nachos and it was literally a mountain. I&#39;m curious on how that is..ha!",
