"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/JsEd0ZSFGAF6E-ew78P5HQ/l.jpg",
"rating":"4.5",
"reviewcomment":"Who loves roast pork belly? Who loves crackling? Who loves runny fried egg with sweet potato slices and an AWESOME combo of Mayo and onion-and-capsicum salsa?<br><br>If you had put your hand up for any of these, let me give you a tip and get yourself down to the Copper Mill. The Peruvian B&amp;E roll or pan con chicharron is a full breakfast bundled between tasty buns. <br><br>Sinking my teeth into this perfect creation of a breakfast sandwich, which I am told is a staple dish for Peruvians on a lazy Sunday, I devoured the roll in only a few minutes before looking at my mate and saying &#34;I can smash down another one, easy&#34;. He agreed and was about to order another one before we checked the time. <br><br>Instead we chose not to as we had to finish up  early but boy was it tempting to order another one take away. <br><br>Get in early cause they have this cool system where, as they sell out each breakfast menu item they pull it off the board until they are completely sold out. Ok not so cool when there is no Peruvian b+e rolls left.",
