"categorystrlist":"Italian",
"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/GUJMd5XOI6uX2uGMVx_f6Q/l.jpg",
"rating":"4.5",
"reviewcomment":"Tonight was my 4th visit (at least I think) and I regret not writing anything sooner. The food, service and ambience are just superb. I keep looking at the restaurant for ideas on how to decorate my kitchen/dining room.<br><br>I went tonight for my birthday dinner with my partner. I have to give an honourable mention to Andy (The Maître d&#39;) and Lydia, the wonderfully knowledgeable waitress - master of food description (I can&#39;t think of a more honorary title, sorry) .<br><br>The food is always fresh, creative and superb. I&#39;ve also been lucky that at each visit the menu has been refreshed to reflect the season.<br><br>Tonight we had the &#34;Fritella affumicato - potato &amp; leek pancake - smoked salmon - salmon roe&#34; and &#34;Gamberi al vapore - steamed prawns - pearl barley - chick peas - baby spinach - lemon olive oil &#34; as entree. Followed by &#34;Chatham Island blue cod - spinach - salsa crudo&#34; and &#34;Risotto con funghi - porcini mushrooms - vermouth - thyme&#34;... all I can say about the food and service is &#34;FAULTLESS AND WONDERFUL&#34;. <br><br>It&#39;s also wonderful that the background noise has been baffled by very clever design. My partner is  Deaf and needs limited background noise and good light to be able to to lip read. The very discreet ceiling baffles and good lighting are very conducive to this. Thank you La Scala for the intuitive design.<br><br>I really can&#39;t wait to go back again. LOVE LOVE LOVE. Thank you La Scala for another wonderful meal and evening.<br><br>P.S. I forgot to mention, the raspberry and almond tart with pistachio ice cream is an awesome dessert. Make sure you leave room!",
