"ogimage":"http://s3-media1.ak.yelpcdn.com/bphoto/5xVwhZcsCICHHEuXXjJnnQ/l.jpg",
"rating":"4.5",
"reviewcomment":"We were hungry for Thai food and wanted something different and not to far from home. Generally neither me or my partner would go to a restaurant with mixed nationality cuisine (in this case Vietnamese &amp; Thai) but Mekong has many good reviews on the internet. The place serves as a takeaway shop, but the eat-in space is set up pretty nicely - its clean, has nice sturdy tables and chairs, and the noodle bar is of fresh ingredients on display behind behind glass. <br><br>We ordered fish cakes to start, it is at $6 &amp; it is delicious! There is a good balance of herbs, and it is nice and moist when you bite in. I ordered chicken Tom Yum and was served a big bowl of it, the soup is well flavoured, the veges &amp; meat were plenty, and it was refreshing &amp; not oily at all. Hubby had a nasi goreng, again its well spiced, and all the rice were nicely coated in sauce (no white rice visible).<br><br>Both of us left happy and satisfied. Although there are many people come and go with takeaway but as the seats are inside it didn&#39;t bother us at all. We overheard them speaking Vietnamese in the kitchen, so we&#39;re very curious to try their Vietnamese cuisine next time!",
