"rating":"3.5",
"reviewcomment":"Oh, but The Flynn brings a touch of 1940&#39;s movie-star glamour to Bligh St. <br><br>The tasteful sports bar fronting the street is great for a midday spritzer (add gin to taste) or an after-work tipple. Swirl your drink thoughtfully while you can gaze out upon the great commercial precinct of our city and watch its native animals, with their purposeful stares and gabardine pelts, prowl along asphalt corridors of Sydney&#39;s concrete jungle.  <br><br>For something more demure and intimate, and all-together classy, retire to the function room further inside The Flynn, a wonderfully decorated private area home to a restaurant with an internationally-themed menu with a European flavour that aldo houses some killer specials, like Tuesday all-you-can-eat pizza for just 15 clams. I love when style is paired with affordability. <br><br>Hey, look at that, I got all the way through this review without making one obvious Errol Flynn reference. And then ruined it by calling attention to the fact. Blast.",
