"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/OoPqPCpOuMItAszz07idqA/l.jpg",
"rating":"4.0",
"reviewcomment":"This is Thai with a sandwich flavor. Not literally (because, ew) but numerically. There is Thai food here and there are sandwiches. And banana bread. And fruit juices. And my God, it works. <br><br>Kuk Thai is not made for the idle person. There&#39;s seating but it&#39;s sparse (there are enough seats for about six people) and the others come and go. And come and go. And come and go. It could be Central Station in here (perhaps more Chatswood). I always sit because I want to savor. I get the Pad Gra Pao (chili, basil, garlic and capsicum) with chicken and brown rice (what a delicacy that has proven to be in Sydney) and it is phenomenal. Really fresh and really collourful and really tasty. The Pad Kee Mao noodles with chicken are also a stand-out. <br><br>If you want a sandwich you&#39;re also in luck. They have everything you would expect from a sandwich bar and it&#39;s cheap. Juices here also look great.<br><br>One other thing you need to do. Go for the lunch special. $10.90 for a meal and drink.",
