"rating":"4.0",
"reviewcomment":"Beautiful Italian cuisine on a plate. Probably not as a great as the Melbourne version, however it was worth joining the parade of hungry eaters on a beautiful summer Saturday night with a date in tow; the love of my life back at the time. Simple but elegant. Designed for you to eat and appreciate outside. Their pasta packs some punch; especially the fettuccine carbonara: oh so thick and creamy; but not to the point where you feel so bloated afterwards. Eating pasta at this establishment makes you feel that you might have been Italian in a previous life.<br><br>It can get addictive, and within good reason as well. Please don&#39;t come here every weekend if you eat out every weekend; there is more of Leichhardt&#39;s culinary delights to explore. Lygon Street is to Melbourne as Norton Street is to Sydney. I rest my case. In saying this, an awesome dining experience overall: so make Sapore a destination you will come back to again and again in the future; especially if the food and the great customer service is consistent each and every time. Great with a date, or even with a few of your close friends. Don&#39;t know why; however eating in a large group just wouldn&#39;t cut it for me here.",
