"reviewcomment":"Located just up the escalators on the George St. side of the arcade, this cafe has made an awesome land grab and occupies the entire corner of the floor. Also accessible via the lobby of 420 George St, I love that you are able to sit out on the balcony like area for a quieter experience.<br><br>The coffee here was actually not that bad. While there was more milk than I required, compared to most cafes around here, the layered effect they achieved looked pretty damm tempting. Unfortunately it suffers from inconsistency and so I can&#39;t give it a 4 star review, but if you are looking for a quiet cafe for a business meeting that serves decent coffee, this might be the place for you.<br><br>The lasting memory I have of this cafe is the excellent service. Certainly a big *thumbs up* from me. <br><br>Cafe Summary<br>------------------------<br>Passion for Coffee                - 7/10<br>Coffee beans                        - Allpress<br>Crema (1=burnt, 10=velvet)  - 7/10<br>Special coffees avail?           - N/A",
