"rating":"4.0",
"reviewcomment":"My friends and I came here on St Patty&#39;s Day after the races.  We knew every Irish pub would be packed, but our friend was like, &#34;We&#39;ll go to Porterhouse, nobody knows about it.&#34;  We hopped in a cab and was unpleasantly surprised to see a long que outside. So we waited and it only took about 20 minutes.<br><br>Got in and there were green hats and drunken Irish and Australians everywhere. It was great!  I ordered a cider and my friends got Guinness. <br><br>We drank and chatted and had good fun.  <br><br>After a few drinks, I started to get a bit hungry. I was happy to see that they had curry chips on the menu.  I went up to the food station and asked for curry chips and potato wedges.  Sadly there was $20 maximum credit card charge, but the lady pointed me to the ATM.  Was a bit drunk and it took me a while, but I got cash and ordered the food. Don&#39;t know if I was just drunk, but those curry chips were AMAZING! <br><br>Overall a great Irish pub.",
