"rating":"3.0",
"reviewcomment":"Went here with my boyfriend as it is just close by our apartment. I cant remember the name of what I ordered but it was a bento box with a lot of fried food.. Lol.. ill explain.. my order was with chicken karaage, chicken teriyaka and tempura (prawns, calamari and vegetables). <br><br>The food i ordered was good, but I don&#39;t know why i ordered so much fried food when i was at a sushi place. The chicken teriyaki was really good. I don&#39;t usually like tempura as it is too oily but I ate the prawns (1 piece) and calamari (1 piece).<br><br>My boyfriend got the salmon lovers bento box which had SO MUCH SALMON! From memory it was around $21. There were salmon roles, nigiri sushi and then sashimi. The quality of the salmon was good, and it tasted fresh (i just had a piece of everything on his plate). <br><br>It is a little hole in the wall, nothing too fancy. It was quite packed actually. We just walked in on a Friday night, it is a casual spot to dine. Saw many different types of groups, families, dates, and groups of adults. I would come here again. It is nothing special, but when craving sushi, and its close by, then i would choose this place due to convenience.",
