"rating":"3.0",
"reviewcomment":"To be frank upon walking into this place I thought I had mistakenly walked into Starbucks. The tables, chairs, the colour palette, and the buzz of the place just reminded me of one of Starbucks&#39; many coffee houses in the Sydney CBD. <br><br>The other customers who were there looked like they could have been the frequent Starbucks types: University students on their lap tops, businessmen having coffees with their colleagues and small groups of people having talks over a few beverages and cakes. <br><br>Anyway I came here to try their famous honey toast they&#39;re famous for. Basically it&#39;s slabs of thick cut buttered  toast, drizzled with honey and lots of whipped cream on top. Definitely something you would avoid if you are watching your waistline however I am not one one of those people. <br><br>It was absolutely divine! The buttered honey toast and whipped cream was simply indulgent and just melt in your mouth goodness. <br><br>Luckily I shared with a friend because the portion was HUGE and it got quite sickening after a few bites. Definitely share with someone else if you&#39;re not a sweet tooth as it&#39;s a major sugar overload. Also really like their coffees which comes in hugs cups! <br><br>I like this place! Definitely will be back for their coffees and the honey toast.",
