"rating":"5.0",
"reviewcomment":"I&#39;m an hard marker. Just look at my other reviews. I&#39;ve only handed out one other 5-star review. This place is THAT good. <br><br>So it&#39;s sandwiches - big deal, I hear you say. Yes, it IS a big deal. It doesn&#39;t matter that there is a line up to order. Because that line moves mighty fast. And you need the time to read the blackboard to decide on your sandwich. Once you&#39;ve placed your order with the friendly and evidently competent chap whose sole job it is to welcome you, advise you on options, then take your small amount of cash for what you are getting in exchange, you then wait outside. Within 5 minutes, even when it&#39;s the busy period, you have your sandwich in hand. Toasted or not. And it&#39;s bursting with filling. There are no corners cut here. This place is legit. <br><br>The other aspect that has me gushing are the juices. Freshly pressed in minutes upon ordering, your cup is filled to the brim with juice, not ice. It&#39;s 100% juice. <br><br>One toasted sandwich on Turkish and a large juice that I couldn&#39;t finish in one sitting: $14. Coming from Perth, let me tell you, that is astounding value. In a great way. <br><br>You won&#39;t regret it. All those people lining up each day cannot be wrong.",
