"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/Pb6UpoklpDc7kYdcStWsng/l.jpg",
"rating":"4.5",
"reviewcomment":"I like the Rose Hotel because it reminds me of San Francisco. The building is near 100 years old and has a very classic pub feeling in the front. The back, however, is a huge communal patio that begs you to kick back for an after work (or uni) schooner and befriend your neighbors. I went first on a sunny Sunday afternoon and there was a live band set up outside jammin&#39; old rock tunes. My friends and I parked on one of the long wooden benches with a bottle of white and got to chatting with those around us. I found the vibe to be very hipster, alternative - chic. I&#39;ve gone again on a Friday for happy hour and observed an influx of young professionals from the arts / media companies in surrounding Chippendale. <br><br>Food and drink wise, the place is above average on the pub grub spectrum. They have delicious pizzas from pesto pumpkin to potato, rosemary &amp; prosciutto, all between $15-$20 each. A standout is the Mexican Rose which contains chorizo, Spanish onions, roasted capsicum, jalapenos, mozzarella cheese and refried beans,<br>garnished with guacamole, sour cream and corn chips ($20). This place is definitely kickass, I recommend you get yourself here on the double.",
