"rating":"4.5",
"reviewcomment":"In case you&#39;ve been living under a rock, these little Middle Eastern holes in the wall are popping up all over Sydney. They may be small, but they pack a serious flavour punch. And they make a mean coffee. Every sixth free must be as generous as it gets in Sydney. Then there&#39;s the toasted sesame seed bagel for $5 and throw in a coffee for $6. My daily morning mocha puts a spring in my sunrise step and &#39;happy as&#39; staff put a smile on my melon. Not a bad way to kick off every day. The coffee is that good, you can always bank on a line-up - unless it&#39;s you&#39;re lucky day (so buy a lotto ticket!) ... but this is your opportunity to catch up on all the latest celebrity goss. Trashy mags galore are readily available for Sabbaba customers. One tip: read &#39;em while they&#39;re fresh - pre someone&#39;s greasy falafel fingers. Dine on freshly baked pita pockets and baklava galore. The Sabbaba pita is the go... falafel balls, village salad, tabouli, red cabbage, pickles, hummus, tahini, babaganoush and salsa. Oh yeah... bring you&#39;re appetite cuz they&#39;re hefty!",
