"rating":"4.5",
"reviewcomment":"Every time I come here this place reminds me of being in Seoul for some reason. Maybe its the decor.<br><br>I mainly come here for the $10 lunch specials (which include dolsot bimbimbap), and have recently tried the charcoal based BBQ (which I recommend in this place if you got the chance).<br><br>A notable thing to also try here is the lemon soju (be careful, just because you can&#39;t taste the alcohol it doesn&#39;t mean its not there!)<br><br>Pricing wise (for BBQ at least) its a little bit more than what you&#39;d pay for Korean BBQ in the area, but this place offers something unique where the BBQ is charcoal based. Also an added bonus is because this place is well ventilated (and with inbuilt vents above the BBQ stove), your clothes don&#39;t end up smelling as bad.<br><br>Last but not least, its actually easier to get a table here than next door&#39;s Madang (where theres nothing really special about it once you&#39;ve been).<br><br>I&#39;m sure I&#39;ll be back here again.",
