"ogimage":"http://s3-media3.ak.yelpcdn.com/bphoto/SbDOLKubt8Fab1svXPw_Xw/l.jpg",
"rating":"4.5",
"reviewcomment":"Following our local colleague&#39;s lead for a quick Ultimo lunch before a meeting, we made our way into Malacca Straits after the Thai place he originally had in mind was closed for the afternoon, and I think fate was on our side.<br><br>It&#39;s an open, airy Malaysian/Thai restaurant that has a little something for any taste.  I had the chili prawns lunch special, and my companions went with the chicken laksa and beef rendang, and we shared some roti to soak up the various juices and sauces.  Each dish was distinctive, delicious, and inexpensive.  In particular the rendang was a big hit.  The total bill, including drinks and tip, averaged about $14 each.<br><br>The restaurant is a perfect setting for a casual afternoon lunch, with efficient, friendly service and prompt meal prep.  But if I&#39;m lucky enough to find myself in Sydney again sometime, I&#39;m going to try and get back for the BYO chili crab dinner - bring your own crab and they&#39;ll whip you up a Malaysian style chili crab for only $20.<br><br>Apparently there are imposter Malacca Straits around town trying to cash in on the reputation Chef Tan has built with this Broadway eatery, and there are certainly worse horses to hitch your wagon to.",
